INSERT INTO `fbcache` (`id`, `content`, `updated`) VALUES
	(1, '<li><img src="https://scontent.xx.fbcdn.net/hphotos-xap1/v/t1.0-0/p130x130/12310440_10153811356468442_44545186725895723_n.png?oh=4eba3f8af7458a703e9b22247c805ab0&oe=56E824D7" /><div id="clamp1">Prieš šventes visi norime būti geri ir sukaupti kuo daugiau karmos taškų. :) Mes galime Tau padėti: www.aukokdaiktus.lt.  \n#AsEsuHerojus</div><a target="_blank" href="https://www.facebook.com/aukokdaiktus/photos/a.487432453441.275288.283520278441/10153811356468442/?type=3"><div class="angles"><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i></div></a></li><li><img src="https://external.xx.fbcdn.net/safe_image.php?d=AQCoxXBsifpaGhXe&w=130&h=130&url=http%3A%2F%2Fcdn.kasvyksta.lt%2Fwp-content%2Fuploads%2F2015%2F12%2FKVK_3435.jpg&cfs=1" /><div id="clamp2">Apie tuos, kuriems kartu su Jūsų pagalba padedame augti. Susipažinkite, kaip Vaikų gerovės centras "Pastogė" siekia mažinti vaikų skaičių globos namuose. :) \n\nŠiai organizacijai ir jos globotiniams galime padėti čia: http://aukokdaiktus.lt/stokojantysis/3793</div><a target="_blank" href="http://kaunas.kasvyksta.lt/2015/12/10/miestas/naujove-kaune-leisianti-nevezti-vaiku-i-globos-namus/#"><div class="angles"><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i></div></a></li><li><img src="https://external.xx.fbcdn.net/safe_image.php?d=AQDzrd2yIPA7bUyE&w=130&h=130&url=https%3A%2F%2Fscontent-frt3-1.xx.fbcdn.net%2Fhphotos-xpl1%2Ft31.0-8%2F12362745_10153825341628442_8266712343900249240_o.jpg&cfs=1" /><div id="clamp3">Dalinamės pamąstymais iš įvairių perspektyvų apie kalėdinį labdaros laikotarpį. :)</div><a target="_blank" href="http://valstietis.tv3.lt/Pradzia/Naujienos/Lietuvoje/Labdara-gerais-norais-i-pragara-grista"><div class="angles"><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i></div></a></li>', '2015-12-13 16:14:21'),
	(2, '<li><img src="https://scontent.xx.fbcdn.net/hphotos-xap1/v/t1.0-0/p130x130/12310440_10153811356468442_44545186725895723_n.png?oh=4eba3f8af7458a703e9b22247c805ab0&oe=56E824D7" /><div id="clamp1">Prieš šventes visi norime būti geri ir sukaupti kuo daugiau karmos taškų. :) Mes galime Tau padėti: www.aukokdaiktus.lt.  \n#AsEsuHerojus</div><a target="_blank" href="https://www.facebook.com/aukokdaiktus/photos/a.487432453441.275288.283520278441/10153811356468442/?type=3"><div class="angles"><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i></div></a></li><li><img src="https://external.xx.fbcdn.net/safe_image.php?d=AQCoxXBsifpaGhXe&w=130&h=130&url=http%3A%2F%2Fcdn.kasvyksta.lt%2Fwp-content%2Fuploads%2F2015%2F12%2FKVK_3435.jpg&cfs=1" /><div id="clamp2">Apie tuos, kuriems kartu su Jūsų pagalba padedame augti. Susipažinkite, kaip Vaikų gerovės centras "Pastogė" siekia mažinti vaikų skaičių globos namuose. :) \n\nŠiai organizacijai ir jos globotiniams galime padėti čia: http://aukokdaiktus.lt/stokojantysis/3793</div><a target="_blank" href="http://kaunas.kasvyksta.lt/2015/12/10/miestas/naujove-kaune-leisianti-nevezti-vaiku-i-globos-namus/#"><div class="angles"><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i></div></a></li><li><img src="https://external.xx.fbcdn.net/safe_image.php?d=AQDzrd2yIPA7bUyE&w=130&h=130&url=https%3A%2F%2Fscontent-frt3-1.xx.fbcdn.net%2Fhphotos-xpl1%2Ft31.0-8%2F12362745_10153825341628442_8266712343900249240_o.jpg&cfs=1" /><div id="clamp3">Dalinamės pamąstymais iš įvairių perspektyvų apie kalėdinį labdaros laikotarpį. :)</div><a target="_blank" href="http://valstietis.tv3.lt/Pradzia/Naujienos/Lietuvoje/Labdara-gerais-norais-i-pragara-grista"><div class="angles"><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i><i class="fa fa-angle-right"></i></div></a></li>', '2015-12-13 16:22:53');
