	(2, 0, 'Apie', '<h2>aukoklaika.lt</h2>\r\n\r\n<p>aukoklaika.lt &ndash; tai ketverius metus gyvuojančio projekto <a href="http://www.aukokdaiktus.lt" target="_blank"><strong>aukokdaiktus.lt</strong></a>&nbsp;vystymo iniciatyva. &Scaron;ie abu projektai (toliau &ndash; Gerumo tinklas) &ndash; tai atviras visiems Lietuvos žmonėms tinklas, kuris jungia tuos, kam reikalinga pagalba įvairiais daiktais bei darbais, ir tuos, kurie gali tą pagalbą suteikti.</p>\r\n\r\n<table border="0" cellpadding="5" cellspacing="1" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2" style="text-align:center">\r\n			<h2>Projekto veikimo principai</h2>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:left; vertical-align:top; width:50%">\r\n			<h3>savanorystė</h3>\r\n\r\n			<p>Projektas įgyvendinamas su savanorių tinklo visoje Lietuvoje pagalba.<br />\r\n			&nbsp;</p>\r\n\r\n			<h3>bendruomeni&scaron;kumas</h3>\r\n\r\n			<p>Iniciatyvomis yra skatinamas bendruomeni&scaron;kumas, nes daugumą darbų reikia atlikti fizi&scaron;kai susitinkant su poreikio užsakovu. Tai suartina kaimynus, priverčia pažinti kitus bendruomenės narius, paskatina vieni kitiems padėti daiktais ar paslaugomis ir pastebėti, kam &scaron;alia yra reikalinga pagalba.</p>\r\n			</td>\r\n			<td style="text-align:left; vertical-align:top; width:50%">\r\n			<h3>pagalba ir parama tik pagal poreikį</h3>\r\n\r\n			<p>Visų pirma, su savanorių pagalba į internetinę sistemą yra registruojami įvairių darbų poreikiai, o po to žmonės pagal savo galimybes gali atrasti, kam ir kuo gali padėti.</p>\r\n\r\n			<h3>atsakomybė ir pasitikėjimas</h3>\r\n\r\n			<p>Kiekvienas prisidedantis prie projekto prisiima atsakomybę už savo veiksmus, pasiūlymus ir elgesį. Tai apibrėžta projekto taisyklėse.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Iniciatyva įgyvendinama pagal projektą &bdquo;aukoklaika.lt &ndash; efektyvesniam socialinių problemų sprendimui&rdquo;, nr. VP1-4.1-VRM-08-V-01-003</strong></p>\r\n\r\n<p><strong>Projektą įgyvendina:</strong>&nbsp;V&scaron;Į &bdquo;Geros valios projektai&ldquo;</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Projektas &bdquo;aukoklaika.lt - efektyvesniam socialinių problemų sprendimui&ldquo; Nr. VP1-4.1-VRM-08-V-01-003, finansuojamas Europos socialinio fondo ir Lietuvos Respublikos valstybės biudžeto pagal 2007-2013 m. Žmogi&scaron;kųjų i&scaron;teklių veiklos programos 4 prioriteto &bdquo;Administracinių gebėjimų stiprinimas ir vie&scaron;ojo administravimo efektyvumo didinimas&ldquo; įgyvendinimo priemonę VP1-4.1-VRM-08-V &bdquo;Valdžios ir nevyriausybinio sektorių bendradarbiavimas ir partnerystė&ldquo;.</p>\r\n\r\n			<p><strong>Projekto partneris:</strong> LR Socialinės apsaugos ir darbo ministerija&nbsp;</p>\r\n\r\n			<p><a href="http://www.esparama.lt/" target="_blank"><img alt="" src="http://www.aukoklaika.lt/img/eu.png" style="height:100px; width:247px" /></a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<a href="www.socmin.lt" target="_blank"><img src="https://www.aukok.lt/Content/files/Remeju_logo/sadm.png" style="height:100px; width:100px" /></a></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><strong>Projekto tikslas</strong>: Sukurti NVO ir valstybinio sektoriaus įstaigų bendradarbiavimo sistemą aukoklaika.lt efektyvesniam socialinių problemų sprendimui.</p>\r\n\r\n			<p><strong>Projekto uždaviniai: </strong></p>\r\n\r\n			<ol>\r\n				<li>sukurti NVO ir valstybinio sektoriaus įstaigų bendradarbiavimo tinklą socialinėms problemoms spręsti</li>\r\n				<li>skatinti NVO ir valstybinio sektoriaus bendradarbiavimą</li>\r\n			</ol>\r\n\r\n			<p><strong>Pagrindinės projekto veiklos:</strong></p>\r\n\r\n			<ol>\r\n				<li>aukoklaika.lt internetinio tinklapio kūrimas</li>\r\n				<li>NVO ir valstybinio sektorių bendradarbiavimo tinklo per aukoklaika.lt iniciatyvą kūrimas</li>\r\n				<li>Informacinės-metodinės medžiagos kūrimas</li>\r\n				<li>NVO ir valstybinio sektorių bendradarbiavimo patirties dalijimosi seminarai</li>\r\n				<li>Regioniniai aukoklaika.lt bendradarbiavimo tinklo narių susitikimai patirties dalijimuisi</li>\r\n				<li>Konferencija NVO ir valstybinio sektorių atstovų bendradarbiavimui</li>\r\n			</ol>\r\n\r\n			<p><strong>Kontaktai: </strong></p>\r\n\r\n			<p>Projekto veiklų vadovė Marija &Scaron;araitė: marija@aukokdaiktus.lt, 867882132</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2014-05-27 13:13:47', '0000-00-00 00:00:00', 1819, 'apie', 0, 0),
