	(4, 0, 'Padėk', '<table border="0" cellpadding="10" cellspacing="0" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align:center; vertical-align:top; width:33%">\r\n			<p><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395664929_padek1.png" style="height:40px; width:40px" /></p>\r\n\r\n			<h2>Ie&scaron;kok</h2>\r\n\r\n			<p>ir sužinok, kam reikalinga pagalba, kurią Jūs galite suteikti. Ie&scaron;koti darbų poreikių galite pagal&nbsp;darbų kategorijas, gyvenamąją vietą ir pagalbos gavėjo tipą</p>\r\n			</td>\r\n			<td style="text-align:center; vertical-align:top; width:33%">\r\n			<p><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395664948_padek2.png" style="height:40px; width:40px" /></p>\r\n\r\n			<h2>Susisiek</h2>\r\n\r\n			<p>užsiregistravęs <strong>aukoklaika.lt</strong>&nbsp;tinklapyje arba įvesk savo duomenis padedant vieną kartą</p>\r\n			</td>\r\n			<td style="text-align:center; vertical-align:top; width:33%">\r\n			<p><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395664966_padek3.png" style="height:40px; width:40px" /></p>\r\n\r\n			<h2>Padėk</h2>\r\n\r\n			<p>atlikdamas pasirinktą darbą</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Jei ketinate padėti ne vieną kartą, rekomenduojame užsiregistruoti <strong>aukoklaika.lt</strong>&nbsp;tinklapyje &ndash; taip pasirinkti kitus darbus bus greičiau ir patogiau. Registracijos metu reikia nurodyti savo asmens duomenis, slaptažodį, su kuriuo tuojau pat galėsite prisijungti. Įvedant duomenis dėl pagalbos reikia nurodyti savo asmens duomenis, susipažinti su <strong>aukoklaika.lt</strong>&nbsp;taisyklėmis, sutikti su jų turiniu bei jų laikytis.</p>\r\n\r\n<p>Smulkesnę informaciją, kaip atlikti pasirinktą darbą, Jums suteiks<strong>&nbsp;aukoklaika.lt</strong>&nbsp;kuratorius. Daugeliu atvejų skatinama susitikti ar pabendrauti trise: Jūs &ndash; geradarys, kuratorius ir pagalbos gavėjas, kad atliekant darbą nekiltų neai&scaron;kumų.</p>\r\n\r\n<p>Jeigu kiltų neai&scaron;kumų ar nesusipratimų&nbsp;<em>&ndash;</em>&nbsp;mes visuomet pasiruo&scaron;ę <a href="/kontaktai">Jums padėti</a>.</p>\r\n', '2014-03-27 12:38:27', '0000-00-00 00:00:00', 3, 'padek', 0, 0),
	(5, 0, 'Gauk pagalbos', '<h2>aukoklaika.lt &mdash; pagalba tau</h2>\r\n\r\n<p>Pagalbos darbais tinkle pagalbą savanori&scaron;kais darbais gauna ir fiziniai, ir juridiniai asmenys. Jie gali pra&scaron;yti įvairiausios pagalbos: mokymų, laisvalaikio leidimo kartu ar kamino i&scaron;valymo. Svarbu, kad pagalba i&scaron;spręstų&nbsp; konkrečią problemą.</p>\r\n\r\n<table align="left" border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="vertical-align:top; width:50%">\r\n			<h2><strong>Galimi fiziniai pagalbos gavėjai:</strong></h2>\r\n\r\n			<ul>\r\n				<li>Daugiavaikė &scaron;eima;&nbsp;</li>\r\n				<li>Jauna &scaron;eima su vaiku (-ais);</li>\r\n				<li>Mažas pajamas turinti &scaron;eima;</li>\r\n				<li>&Scaron;eima, auginanti negalią turintį vaiką;</li>\r\n				<li>Vieni&scaron;as tėvas (mama);&nbsp;</li>\r\n				<li>Negalią turintis žmogus;</li>\r\n				<li>Priklausomybę nuo alkoholio turėjęs žmogus (po reabilitacijos);&nbsp;</li>\r\n				<li>Priklausomybę nuo narkotinių medžiagų turėjęs žmogus;&nbsp;</li>\r\n				<li>Smurto auka;&nbsp;</li>\r\n				<li>Pabėgėlis (-iai);</li>\r\n				<li>Na&scaron;laitė (-is);</li>\r\n				<li>Vieni&scaron;as senjoras (-ė);</li>\r\n				<li>Žmogus, atlikęs laisvės atėmimo bausmę;&nbsp;</li>\r\n				<li>Žmogus, buvęs vaikų globos institucijoje;</li>\r\n				<li>Darbo netekęs žmogus;</li>\r\n				<li>Žmonės, per gaisrą netekę savo turto.</li>\r\n			</ul>\r\n			</td>\r\n			<td style="vertical-align:top; width:50%">\r\n			<h2><strong>Galimi juridiniai paramos gavėjai:</strong></h2>\r\n\r\n			<ul>\r\n				<li>Senjorų namai;</li>\r\n				<li>Vaikų globos institucija;</li>\r\n				<li>Vaiko ir motinos globos institucija;</li>\r\n				<li>Negalią turinčių žmonių globos institucija;</li>\r\n				<li>Socialinių paslaugų centras;</li>\r\n				<li>Reabilitacijos centras;</li>\r\n				<li>Pilietinė nevyriausybinė organizacija;</li>\r\n				<li>Bendruomenė.</li>\r\n			</ul>\r\n\r\n			<h2><strong>Pagalbos gavėju teisės tapti neturi:</strong></h2>\r\n\r\n			<ul>\r\n				<li>Mokyklos ir vaikų darželiai;</li>\r\n				<li>Komercine veikla užsiimančios įmonės;</li>\r\n				<li>Organizacijos, vienijančios tokį pat arba pana&scaron;ų pomėgį turinčius narius;</li>\r\n				<li>Žmonės, turintys priklausomybę alkoholiui ir/arba narkotikams;</li>\r\n				<li>Tie, kurie gavę paramą ją panaudojo netikslingai.</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<h2>&nbsp;</h2>\r\n', '2014-03-24 12:23:10', '0000-00-00 00:00:00', 3, 'gauk', 0, 0),
