	(19, 0, 'Savanoriauk', '<p><span style="line-height:1.6em">Ir Tu gali tapti mūsų komandos nariu!</span></p>\r\n\r\n<p>Jei nori būti&nbsp;aukoklaika.lt&nbsp;savanoriu, kreipkis naudodamasis&nbsp;<a href="/kontaktai">kontaktų forma</a>&nbsp;ir nurodyk, kurioje sferoje norėtum savanoriauti:&nbsp;</p>\r\n\r\n<p><strong>1. Tinklo atstovai</strong>&nbsp;<em>&ndash;</em>&nbsp;tai žmonės, kurie yra atsakingi už&nbsp;aukoklaika.lt&nbsp;tinklo vystymą. Jie savo kra&scaron;te ie&scaron;ko savanorių kuratorių, juos apmoko, prijungia prie tinklo, bendradarbiauja su vietos socialiniais darbuotojais, socialinės rūpybos įstaigomis.</p>\r\n\r\n<p><strong>2. Kuratoriai</strong>&nbsp;<em>&ndash;</em>&nbsp;tai&nbsp;tarpininkai tarp&nbsp;aukoklaika.lt&nbsp;tinklo, geradario ir pagalbos gavėjo. Jie ie&scaron;ko žmonių, kuriems reikalinga pagalba darbais, vykdo jų atranką, bendrauja su geradariais ir pagalbos gavėjais, organizuoja efektyvų ir kokybi&scaron;ką savanori&scaron;kų darbų atlikimą.</p>\r\n\r\n<p><strong>3. Funkcinės savanorių komandos</strong>&nbsp;<em>&ndash;</em>&nbsp;tai&nbsp;savanoriai, koordinuojantys viso tinklo veiklą ir atsakingi už tam tikras veiklos sritis (vie&scaron;inimas, logistika, darbas su savanoriais, IT darbai, partnerystė su verslu, projektų valdymas ir pan.).</p>\r\n', '2014-02-25 11:57:08', '0000-00-00 00:00:00', 3, 'savanoriauk', 0, 0),
	(20, 0, 'DUK', '<p>#####Kaip galima padėti?###1###</p>\r\n\r\n<ol>\r\n	<li>Sužinokite, kam reikalinga pagalba, kurią Jūs galite suteikti.</li>\r\n</ol>\r\n\r\n<p>Ie&scaron;koti darbų poreikių galite pagal&nbsp;darbų kategorijas, gyvenamąją vietą ir pagalbos gavėjo tipą.&nbsp;Taip pat galite pasinaudoti paie&scaron;kos forma.&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Užsiregistruokite&nbsp;<strong>aukoklaika.lt</strong>&nbsp;tinklapyje arba įveskite savo duomenis padedant vieną kartą.&nbsp;</li>\r\n	<li>Paskelbkite apie atliekamą darbą.</li>\r\n</ol>\r\n\r\n<p>Norėdami atlikti pasirinktą darbą, pasirinkite meniu punktą &bdquo;Padedu&ldquo; ir suveskite visą pagalbai reikalingą informaciją. Aptarkite su juo savanori&scaron;ko darbo atlikimą.</p>\r\n\r\n<ol>\r\n	<li>Atlikite pasirinktą darbą.</li>\r\n	<li>Prisijunkite prie aukoklaika.lt savanorių tinklo.</li>\r\n</ol>\r\n\r\n<p>#####Kas gali gauti pagalbą aukoklaika.lt tinkle?###2###</p>\r\n\r\n<p><strong>Galimi fiziniai pagalbos gavėjai:</strong></p>\r\n\r\n<ul>\r\n	<li>Daugiavaikė &scaron;eima;&nbsp;</li>\r\n	<li>Jauna &scaron;eima su vaiku (-ais);</li>\r\n	<li>Mažas pajamas turinti &scaron;eima;</li>\r\n	<li>&Scaron;eima, auginanti negalią turintį vaiką;</li>\r\n	<li>Vieni&scaron;as tėvas (mama);&nbsp;</li>\r\n	<li>Negalią turintis žmogus;</li>\r\n	<li>Priklausomybę nuo alkoholio turėjęs žmogus (po reabilitacijos);&nbsp;</li>\r\n	<li>Priklausomybę nuo narkotinių medžiagų turėjęs žmogus;&nbsp;</li>\r\n	<li>Smurto auka;&nbsp;</li>\r\n	<li>Pabėgėlis (-iai);</li>\r\n	<li>Na&scaron;laitė (-is);</li>\r\n	<li>Vieni&scaron;as senjoras (-ė);</li>\r\n	<li>Žmogus, atlikęs laisvės atėmimo bausmę;&nbsp;</li>\r\n	<li>Žmogus, buvęs vaikų globos institucijoje;</li>\r\n	<li>Darbo netekęs žmogus;</li>\r\n	<li>Žmonės, per gaisrą netekę savo turto.</li>\r\n</ul>\r\n\r\n<p><strong>Galimi juridiniai paramos gavėjai:</strong></p>\r\n\r\n<ul>\r\n	<li>Senjorų namai;</li>\r\n	<li>Vaikų globos institucija;</li>\r\n	<li>Vaiko ir motinos globos institucija;</li>\r\n	<li>Negalią turinčių žmonių globos institucija;</li>\r\n	<li>Socialinių paslaugų centras;</li>\r\n	<li>Reabilitacijos centras;</li>\r\n	<li>Pilietinė nevyriausybinė organizacija;</li>\r\n	<li>Bendruomenė.</li>\r\n</ul>\r\n\r\n<p><strong>Pagalbos gavėju teisės tapti neturi:</strong></p>\r\n\r\n<ul>\r\n	<li>Mokyklos ir vaikų darželiai;</li>\r\n	<li>Komercine veikla užsiimančios įmonės;</li>\r\n	<li>Organizacijos, vienijančios tokį pat arba pana&scaron;ų pomėgį turinčius narius;</li>\r\n	<li>Žmonės, turintys priklausomybę alkoholiui ir/arba narkotikams;</li>\r\n	<li>Tie, kurie gavę paramą ją panaudojo netikslingai.</li>\r\n</ul>\r\n\r\n<p>#####Kaip tapti pagalbos gavėju?###3###</p>\r\n\r\n<p><strong>Fiziniams asmenims</strong>&nbsp;<em>&ndash;</em>&nbsp;kreiptis į socialinį darbuotoją Jūsų gyvenamos vietos savivaldos administracijoje, informuoti jį apie <strong>aukoklaika.lt&nbsp;</strong>bei paskatinti kreiptis į Jūsų mieste ar apskrityje esančius&nbsp;<strong>aukoklaika.lt</strong> kuratorius bei tinklo atstovus. Jei tokių Jūsų apskrityje nėra&nbsp;<em>&ndash;</em>&nbsp;kreiptis į&nbsp;<a href="/kontaktai">tinklo&nbsp;administraciją</a>.</p>\r\n\r\n<p><strong>Juridiniams asmenims</strong>&nbsp;<em>&ndash;</em>&nbsp;kreiptis į Jūsų mieste ar apskrityje esančius&nbsp;<strong>aukoklaika.lt&nbsp;</strong>tinklo atstovus. Jei tokių Jūsų apskrityje nėra&nbsp;<em>&ndash;</em>&nbsp;kreiptis į&nbsp;tinklo administraciją.</p>\r\n\r\n<p>#####Ar pagalbos gavėjas gali būti anonimas?###4###</p>\r\n\r\n<p>Pagrindinė&nbsp;<strong>aukoklaika.lt</strong>&nbsp;tinklo vertybė&nbsp;<em>&ndash;</em>&nbsp;skaidrumas,&nbsp;todėl nė vienas tinklo dalyvis negali būti anoniminis.</p>\r\n\r\n<p>Kiekvieno pagalbos gavėjo apra&scaron;yme skelbiama&nbsp;ne tik apie jo poreikius, bet ir apie jam jau atliktus darbus.<br />\r\nSuprantama, kad gali atsirasti pagalbos gavėjų, kurie gali reik&scaron;ti pretenzijas dėl jų asmens duomenų paskelbimo&nbsp;<strong>aukoklaika.lt </strong>tinkle &ndash; todėl kuratoriams, prijungiantiems prie tinklo naujus pagalbos gavėjus (fizinius asmenis), privaloma juos perspėti bei papra&scaron;yti sutikimo.</p>\r\n\r\n<p>#####Kas yra Kuratorius ir kaip juo tapti?###5###</p>\r\n\r\n<p>Kuratorius&nbsp;yra tarpininkas tarp&nbsp;<strong>aukoklaika.lt&nbsp;</strong>tinklo, geradario ir pagalbos gavėjo.&nbsp;</p>\r\n\r\n<p>Kuratoriumi&nbsp;<strong>aukoklaika.lt&nbsp;</strong>tinkle gali būti:</p>\r\n\r\n<ul>\r\n	<li>socialinės srities darbuotojai i&scaron; valstybinio sektoriaus;</li>\r\n	<li>socialinės srities darbuotojai i&scaron; NVO sektoriaus;</li>\r\n	<li>ugdymo įstaigoje dirbantis socialinis pedagogas, kuruojantis moksleivius i&scaron; socialiai remtinų &scaron;eimų;</li>\r\n	<li>labdaros organizacijos savanoris, kuruojantis socialiai remtinus asmenis;</li>\r\n	<li>pagalbos gavėjo<em>&ndash;</em>juridinio asmens vadovo įgaliotas&nbsp;organizacijos darbuotojas;</li>\r\n	<li>visi norintys, motyvuoti ir atsakingi piliečiai, atrinkti projekto komandos.</li>\r\n</ul>\r\n\r\n<p>Pagrindinės kuratoriaus funkcijos:</p>\r\n\r\n<ul>\r\n	<li>pagalbos gavėjų paie&scaron;ka, atranka ir&nbsp;jų kuravimas;</li>\r\n	<li>pagalbos gavėjų poreikių įvedimas į&nbsp;<strong>aukoklaika.lt&nbsp;</strong>sistemą;</li>\r\n	<li>bendravimas su geradariais, pagalba jiems atliekant darbą;&nbsp;</li>\r\n	<li>ry&scaron;ių su savivaldybės socialinių tarnybų ir visuomeninių organizacijų atstovais palaikymas.</li>\r\n</ul>\r\n\r\n<p>Norint tapti Kuratoriumi, reikia kreiptis į Jūsų mieste ar apskrityje esančius<strong>&nbsp;aukoklaika.lt&nbsp;</strong>Tinklo atstovus. Jei tokių Jūsų apskrityje nėra&nbsp;<em>&ndash;</em>&nbsp;kreiptis į&nbsp;Tinklo administraciją.</p>\r\n\r\n<p>#####Kas gali padėti darbais?###6###</p>\r\n\r\n<p>Geradariu gali būti bet kuris fizinis ar juridinis asmuo. Vieną kartą daryti gerą darbą galima ir neužsiregistravus, o padedant daugiau kartų rekomenduojama užsiregistruoti <strong>aukoklaika.lt</strong> tinklapyje. Užsiregistravus tinklapyje turėsite galimybė kaupti savo gerų darbų sąra&scaron;ą.</p>\r\n', '2014-03-21 13:24:10', '0000-00-00 00:00:00', 3, 'duk', 0, 0),
	(21, 0, 'Kontaktai', '<h2>Benraukime</h2>\r\n\r\n<p>Esame atviri Jūsų idėjoms ir pasiūlymams. Bendraukime ir auginkime projektą.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2014-03-27 10:17:18', '0000-00-00 00:00:00', 3, 'kontaktai', 2, 0),
	(22, 0, 'Apie', '<h2>aukokdaiktus.lt</h2>\r\n\r\n<p>aukokdaiktus.lt&nbsp;&ndash; visiems Lietuvos žmonėms atviras tinklas, kuris jungia galinčius suteikti paramą daiktais ar paslaugomis ir tuos, kuriems ji reikalinga.&nbsp;</p>\r\n\r\n<table border="0" cellpadding="5" cellspacing="1" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2" style="text-align:center">\r\n			<h2>Projekto veikimo principai</h2>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:left; vertical-align:top; width:50%">\r\n			<h3>savanorystė</h3>\r\n\r\n			<p>Projektas įgyvendinamas su savanorių tinklo visoje Lietuvoje pagalba.<br />\r\n			&nbsp;</p>\r\n\r\n			<h3>bendruomeni&scaron;kumas</h3>\r\n\r\n			<p>Iniciatyvomis yra skatinamas bendruomeni&scaron;kumas, nes daugumą darbų reikia atlikti fizi&scaron;kai susitinkant su poreikio užsakovu, o daiktai dažniausiai dovanojami yra savo kra&scaron;tiečiams . Tai suartina kaimynus, priverčia pažinti kitus bendruomenės narius ar miestelėnus, paskatina vieni kitiems padėti daiktais ar paslaugomis ir pastebėti, kam &scaron;alia yra reikalinga pagalba.</p>\r\n			</td>\r\n			<td style="text-align:left; vertical-align:top; width:50%">\r\n			<h3>pagalba ir parama tik pagal poreikį</h3>\r\n\r\n			<p>Visų pirma, su savanorių pagalba į internetinę sistemą yra registruojami įvairių darbų poreikiai, o po to žmonės pagal savo galimybes gali atrasti, kam ir kuo gali padėti.</p>\r\n\r\n			<h3>atsakomybė ir pasitikėjimas</h3>\r\n\r\n			<p>Kiekvienas prisidedantis prie projekto prisiima atsakomybę už savo veiksmus, pasiūlymus ir elgesį. Tai apibrėžta projekto taisyklėse.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>aukokdaiktus.lt&nbsp;priklauso gerumo tinklui kartu su iniciatyvomis&nbsp;<a href="https://www.aukok.lt/" target="_blank">Aukok.lt</a>&nbsp;ir <a href="http://www.aukoklaika.lt" target="_blank">aukoklaika.lt</a>.</p>\r\n\r\n<p>Pagabadaiktais.lt&nbsp;inicijavo dvi nevyriausybinės organizacijos &ndash;&nbsp;Geros valios projektai&nbsp;ir&nbsp;Pilietinės atsakomybės fondas.&nbsp;</p>\r\n\r\n<table align="center" border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align:center; vertical-align:top; width:50%">\r\n			<h2><strong>Informaciniai partneris</strong></h2>\r\n\r\n			<h2><a href="http://www.zipfm.lt/" target="_blank"><img alt="ZIP FM logo" src="http://www.zipfm.lt/img/zipfm-logo-beta.gif" style="height:102px; width:230px" /></a></h2>\r\n			</td>\r\n			<td style="text-align:center; vertical-align:top; width:50%">\r\n			<h2><strong>Logistikos partneris</strong></h2>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;<a href="http://www.dbschenker.lt/log-lt-lt/start/" target="_blank"><img src="http://ulvohockey.se/wp-content/uploads/2012/09/logo_db_schenker.jpg" style="height:45px; width:263px" /></a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="text-align:center; vertical-align:top; width:50%">\r\n			<h2><strong>Remėjai:</strong></h2>\r\n\r\n			<p>&nbsp;&nbsp;<a href="http://www.teo.lt/" target="_blank"><img alt="Teo" src="http://admin.aukokdaiktus.lt/uploads/ckeditor/1434846204_logo.png" style="height:69px; width:70px" /></a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <a href="http://www.eeefondai.lt/" target="_blank"><img src="https://www.aukok.lt/Content/files/Remeju_logo/tituliniame_LT_veliava.gif" style="height:36px; width:60px" /></a>&nbsp; &nbsp; &nbsp;<a href="http://www.eeefondai.lt/" target="_blank"><img src="https://www.aukok.lt/Content/files/Remeju_logo/tituliniame_EEA_grants.png" style="height:36px; width:46px" /></a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<a href="http://www.eeefondai.lt/" target="_blank"><img src="https://www.aukok.lt/Content/files/Remeju_logo/tituliniame_Norway_grants.png" style="height:36px; width:74px" /></a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="text-align:center; vertical-align:top; width:50%">\r\n			<h2>&nbsp;</h2>\r\n\r\n			<h2><strong>Draugai:</strong></h2>\r\n\r\n			<p><a href="http://www.esnlithuania.org/" target="_blank"><img alt="logo" src="http://www.esnlithuania.org/profiles/satellite/modules/youthagora/ya_satellite_blocks/images/countries/40/lt.png" style="height:30px; width:86px" /></a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href="http://www.manodrabuziai.lt" target="_blank"><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395924636_drab.png" style="height:33px; width:91px" /></a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<a href="http://musumazyliai.lt" target="_blank"><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395924612_mazyl.png" style="height:38px; width:90px" /></a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href="http://www.redcross.lt/" target="_blank"><img src="http://www.mediaskopas.lt/saugykla/failai/logotipai/lrk-logo1.jpg" style="height:30px; width:30px" /></a>&nbsp; ​ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href="http://www.vilnius.caritas.lt/" target="_blank"><img alt="" src="http://www.caritas-muenster.de/shared_data/forms_layout/dicvmst/208917_Caritas-Logo.jpg" style="height:30px; width:23px" /></a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href="http://www.saulessmiltys.lt/" target="_blank"><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395924657_gel.png" style="height:36px; width:97px" /></a></p>\r\n\r\n			<p><a href="http://www.post.lt/" target="_blank"><img src="http://vialesiai.lt/img/cms/Lietuvos_Pastas_new-logo.jpg" style="height:30px; width:90px" /></a>&nbsp; &nbsp; &nbsp;<a href="http://www.tenta.lt" target="_blank"><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395925036_tenta.png" style="height:27px; width:82px" /></a>&nbsp; &nbsp;&nbsp;<a href="https://www.facebook.com/pages/Mamyciu-turgelis/376253002466088?fref=ts" target="_blank"><img src="https://fbcdn-sphotos-a-a.akamaihd.net/hphotos-ak-frc1/299985_376257825798939_1440211449_n.png" style="height:40px; width:43px" /></a>&nbsp; &nbsp;&nbsp;<a href="http://www.biok.lt/" target="_blank"><img src="http://www.biok.lt/client/images/logo_biok.png" style="height:30px; width:96px" /></a>&nbsp; &nbsp; &nbsp;<a href="http://www.cvmarket.lt/" target="_blank"><img src="http://www.cvmarket.lt/inc/img/cvm_small_logo.gif" style="height:15px; width:125px" /></a>&nbsp;<a href="http://www.dalinuosi.lt/" target="_blank"><img src="https://fbcdn-sphotos-e-a.akamaihd.net/hphotos-ak-prn1/c0.128.851.315/p851x315/886753_507351402706390_1035154423_o.jpg" style="height:30px; width:81px" /></a>&nbsp;<a href="http://www.renkuosimokyti.lt/" target="_blank"><img src="http://www.skautai.lt/public/js/ckfinder/userfiles/images/RM-melynas.jpeg" style="height:30px; width:30px" /></a></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-06-21 03:24:39', '0000-00-00 00:00:00', 4004, 'apie', 1, 0),
	(23, 0, 'Dovanok', '<table border="0" cellpadding="10" cellspacing="5" style="width:726px">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="1" rowspan="1" style="border-color:rgb(255, 255, 255)">\r\n			<p><strong>1. Sužinokite, kas stokoja daikto, kurį Jūs ketinate padovanoti.</strong></p>\r\n\r\n			<p>Ie&scaron;koti galite pagal&nbsp;<a href="http://www.aukokdaiktus.lt/daiktai/kategorija">daiktų kategorijas</a>,&nbsp;<a href="http://www.aukokdaiktus.lt/daiktai/regionai">gyvenamąją vietą</a>&nbsp;ar&nbsp;<a href="http://www.aukokdaiktus.lt/daiktai/stokojantys">stokojančiojo tipą</a>.&nbsp;Taip pat galite pasinaudoti paie&scaron;kos forma.&nbsp;<br />\r\n			&nbsp;</p>\r\n\r\n			<p><strong>2. Užsiregistruokite&nbsp;aukokdaiktus.lt&nbsp;tinkle arba įveskite savo duomenis dovanojant vieną kartą.</strong>&nbsp;</p>\r\n\r\n			<p>Jei ketinate padovanoti ne vieną daiktą, rekomenduojame užsiregistruoti<strong>aukokdaiktus.lt&nbsp;</strong>tinkle &ndash; taip dovanoti bus greičiau ir patogiau. Naujo dalyvio registracija užtrunka vos porą minučių ir nieko nekainuoja. Registracijos metu reikia nurodyti savo asmens duomenis, slaptažodį, su kuriuo tuojau pat galėsite dovanoti. Taip pat Jums reikės susipažinti su&nbsp;<a href="http://www.aukokdaiktus.lt/taisykles"><strong>aukokdaiktus.lt&nbsp;</strong>taisyklėmis</a>. Įvedant duomenis vienkartiniam dovanojimui reikia nurodyti savo asmens duomenis, susipažinti su<a href="http://www.aukokdaiktus.lt/taisykles"><strong>aukokdaiktus.lt</strong>&nbsp;taisyklėmis</a>, sutikti su jų turiniu bei jų laikytis.</p>\r\n\r\n			<p><strong><span style="line-height:1.2em">3. Paskelbkite daikto dovanojimą.</span></strong></p>\r\n\r\n			<p>Norėdami padovanoti, pasirinkite meniu punktą &bdquo;Dovanoti&ldquo; ir suveskite visą dovanojimui reikalingą informaciją. Jei galite, pateikite dovanojamo daikto nuotrauką.&nbsp;Kai tik užregistruosite dovanojimą, stokojančiojo kuratorius elektroniniu pa&scaron;tu atsiųs Jums visą kontaktui su stokojančiuoju reikalingą informaciją. Aptarkite su juo dovanos perdavimą.</p>\r\n\r\n			<p><strong><span style="line-height:1.2em">4. Perduokite dovanojamą daiktą stokojančiam.</span></strong></p>\r\n\r\n			<p>Smulkesnę informaciją, kaip perduoti dovaną, jums suteiks&nbsp;<strong>aukokdaiktus.lt&nbsp;</strong>kuratorius. Daugeliu atvejų galimas nemokamas pristatymas i&scaron; Vilniaus&nbsp;į kitus miestus per TOKS siuntų skyrius. Kai kurie kuratoriai ar gavėjai gali gauti reikalingą transportą, kiti gali papra&scaron;yti dovanotojus patiems atvežti&nbsp;daiktus gavėjams.</p>\r\n\r\n			<p>Jeigu kiltų neai&scaron;kumų ar nesusipratimų&nbsp;<em>&ndash;</em>&nbsp;<a href="/kontaktai">mes visuomet pasiruo&scaron;ę Jums padėti</a>.</p>\r\n			</td>\r\n			<td colspan="1" rowspan="1" style="vertical-align: top; border-color:rgb(204, 204, 204); width:197px">\r\n			<p><strong>Kodėl čia gera dovanoti?</strong></p>\r\n\r\n			<p>Todėl, kad:</p>\r\n\r\n			<p><strong>aukokdaiktus.lt</strong>&nbsp;<em>&ndash;</em>&nbsp;tai gerumo tinklas visoje Lietuvoje, internetinis dovanojimo centras.</p>\r\n\r\n			<p><strong>aukokdaiktus.lt</strong>&nbsp;&nbsp;<em>&ndash;</em>&nbsp;tai interneto vartai, jungiantys galinčius suteikti paramą daiktais ar paslaugoms ir tuos, kuriems &scaron;i parama labai reikalinga.</p>\r\n\r\n			<p><strong>aukokdaiktus.lt</strong>&nbsp; niekada neužsidaro. Jis registruoja Jūsų dovanas 24 valandas per parą, 7 dienas per savaitę.</p>\r\n\r\n			<p>Kasdien čia užregistruojami nauji dalyviai, kuriems labai reikalinga parama, kasdien čia apsilanko norintys padovanoti, o jau padovanoję apsilanko ir vėl, nes gera žinoti, kad gali padėti stokojančiajam.<br />\r\n			&nbsp;<br />\r\n			Kiekvienam norinčiam pasidalinti gerumu dovanojant,&nbsp;<strong>aukokdaiktus.lt</strong>&nbsp; suteikia &scaron;ią galimybę!</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2014-02-25 13:26:38', '0000-00-00 00:00:00', 3, 'dovanok', 1, 0),
	(24, 0, 'Gauk paramą', '<h2>aukokdaiktus.lt &mdash; parama tau</h2>\r\n\r\n<p>Pagalbos daiktais tinkle paramą įvairiais reikalingais daiktais gauna ir fiziniai, ir juridiniai asmenys. Jie gali pra&scaron;yti įvairiausios paramos: nuo drabužių, avalynės iki spintos, kompiuterio ar dviračio. Svarbu, kad parama i&scaron;spręstų&nbsp; konkrečią problemą.</p>\r\n\r\n<table align="left" border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="vertical-align:top; width:50%">\r\n			<h2><strong>Galimi fiziniai paramos gavėjai:</strong></h2>\r\n\r\n			<ul>\r\n				<li>Daugiavaikė &scaron;eima;&nbsp;</li>\r\n				<li>Jauna &scaron;eima su vaiku (-ais);</li>\r\n				<li>Mažas pajamas turinti &scaron;eima;</li>\r\n				<li>&Scaron;eima, auginanti negalią turintį vaiką;</li>\r\n				<li>Vieni&scaron;as tėvas (mama);&nbsp;</li>\r\n				<li>Negalią turintis žmogus;</li>\r\n				<li>Priklausomybę nuo alkoholio turėjęs žmogus (po reabilitacijos);&nbsp;</li>\r\n				<li>Priklausomybę nuo narkotinių medžiagų turėjęs žmogus;&nbsp;</li>\r\n				<li>Smurto auka;&nbsp;</li>\r\n				<li>Pabėgėlis (-iai);</li>\r\n				<li>Na&scaron;laitė (-is);</li>\r\n				<li>Vieni&scaron;as senjoras (-ė);</li>\r\n				<li>Žmogus, atlikęs laisvės atėmimo bausmę;&nbsp;</li>\r\n				<li>Žmogus, buvęs vaikų globos institucijoje;</li>\r\n				<li>Darbo netekęs žmogus;</li>\r\n				<li>Žmonės, per gaisrą netekę savo turto.</li>\r\n			</ul>\r\n			</td>\r\n			<td style="vertical-align:top; width:50%">\r\n			<h2><strong>Galimi juridiniai paramos gavėjai:</strong></h2>\r\n\r\n			<ul>\r\n				<li>Senjorų namai;</li>\r\n				<li>Vaikų globos institucija;</li>\r\n				<li>Vaiko ir motinos globos institucija;</li>\r\n				<li>Negalią turinčių žmonių globos institucija;</li>\r\n				<li>Socialinių paslaugų centras;</li>\r\n				<li>Reabilitacijos centras;</li>\r\n				<li>Pilietinė nevyriausybinė organizacija;</li>\r\n				<li>Bendruomenė.</li>\r\n			</ul>\r\n\r\n			<h2><strong>Paramos gavėju teisės tapti neturi:</strong></h2>\r\n\r\n			<ul>\r\n				<li>Mokyklos ir vaikų darželiai;</li>\r\n				<li>Komercine veikla užsiimančios įmonės;</li>\r\n				<li>Organizacijos, vienijančios tokį pat arba pana&scaron;ų pomėgį turinčius narius;</li>\r\n				<li>Žmonės, turintys priklausomybę alkoholiui ir/arba narkotikams;</li>\r\n				<li>Tie, kurie gavę paramą ją panaudojo netikslingai.</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<h2>&nbsp;</h2>\r\n', '2015-03-25 19:57:40', '0000-00-00 00:00:00', 1819, 'gauk', 1, 0),
	(25, 0, 'Savanoriauk', '', '2014-02-25 13:29:12', '0000-00-00 00:00:00', 3, 'savanoriauk', 1, 0),
	(26, 0, 'DUK', '<p>#####Kas gali gauti paramą aukokdaiktus.lt tinkle?###1###</p>\r\n\r\n<p>Paramos gavėju &mdash; stokojančiuoju gali būti &scaron;ie fiziniai&nbsp;ir juridiniai asmenys:</p>\r\n\r\n<ul>\r\n	<li>Daugiavaikė &scaron;eima;&nbsp;</li>\r\n	<li>Mažas pajamas turinti &scaron;eima;</li>\r\n	<li>Jauna &scaron;eima su vaiku (-ais);&nbsp;</li>\r\n	<li>&Scaron;eima, auginanti negalią turintį vaiką;</li>\r\n	<li>Negalią turintis žmogus;</li>\r\n	<li>Vieni&scaron;as senjoras;</li>\r\n	<li>Vieni&scaron;as tėvas (mama);</li>\r\n	<li>Smurto auka;</li>\r\n	<li>Pabėgėlis (-ė);</li>\r\n	<li>Na&scaron;laitis (-ė);</li>\r\n	<li>Žmogus, buvęs vaikų globos institucijoje;</li>\r\n	<li>Priklausomybę nuo alkoholio turėjęs žmogus (po reabilitacijos);&nbsp;</li>\r\n	<li>Priklausomybę nuo narkotinių medžiagų turėjęs žmogus;&nbsp;</li>\r\n	<li>Žmogus, atlikęs laisvės atėmimo bausmę;</li>\r\n	<li>Darbo netekęs žmogus;</li>\r\n	<li>Žmonės, per gaisrą netekę savo turto;</li>\r\n	<li>Reabilitacijos centras;</li>\r\n	<li>Senjorų namai;</li>\r\n	<li>Vaikų globos institucija;&nbsp;</li>\r\n	<li>Motinos ir veiko globos institucija;</li>\r\n	<li>Negalią turinčių žmonių globos institucija;</li>\r\n	<li>Nevyriausybinės organizacijos;</li>\r\n	<li>Socialinių paslaugų centras;</li>\r\n	<li>Bendruomenė.</li>\r\n</ul>\r\n\r\n<p>Stokojančiuoju aukokdaiktus.lt&nbsp;tinkle teisės tapti neturi:</p>\r\n\r\n<ul>\r\n	<li>Žmonės, turintys priklausomybę alkoholiui ir/arba narkotikams;</li>\r\n	<li>Mokyklos ir vaikų darželiai;</li>\r\n	<li>Komercine veikla užsiimančios įmonės;</li>\r\n	<li>Organizacijos, vienijančios tokį pat arba pana&scaron;ų pomėgį turinčius narius;</li>\r\n	<li>Tie, kurie gautą paramą panaudojo netikslingai.</li>\r\n</ul>\r\n\r\n<p>#####Kaip tapti paramos gavėju &mdash; stokojančiuoju?###2###</p>\r\n\r\n<p><strong>Fiziniams</strong>&nbsp;asmenims&nbsp;<em>&ndash;</em>&nbsp;kreiptis į socialinį darbuotoją Jūsų gyvenamos vietos savivaldos administracijoje, informuoti jį apie<strong>aukokdaiktus.lt&nbsp;</strong>tinklą bei paskatinti jį kreiptis į Jūsų mieste ar apskrityje esančius&nbsp;<a href="http://www.aukokdaiktus.lt/mes-regionuose">Tinklo atstovus</a>. Jei tokių Jūsų apskrityje nėra&nbsp;<em>&ndash;</em>kreiptis į&nbsp;<strong>aukokdaiktus.lt &nbsp;</strong><a href="http://www.aukokdaiktus.lt/kontaktai">Tinklo administraciją</a>.<br />\r\n<strong>Juridiniams</strong>&nbsp;asmenims&nbsp;<em>&ndash;</em>&nbsp;kreiptis į Jūsų mieste ar apskrityje esančius&nbsp;<strong>aukokdaiktus.lt&nbsp;</strong><a href="http://www.aukokdaiktus.lt/mes-regionuose">Tinklo atstovus</a>. Jei tokių Jūsų apskrityje nėra&nbsp;<em>&ndash;</em>&nbsp;kreiptis į&nbsp;<a href="http://www.aukokdaiktus.lt/kontaktai">Tinklo administraciją</a>.</p>\r\n\r\n<p>#####Ar stokojantysis gali būti anonimas?###3###</p>\r\n\r\n<p>Pagrindinė&nbsp;<strong>aukokdaiktus.lt</strong>&nbsp;tinklo vertybė&nbsp;<em>&ndash;</em>&nbsp;skaidrumas,&nbsp;todėl nė vienas tinklo dalyvis negali būti anoniminis.</p>\r\n\r\n<p>Kiekvieno stokojančiojo apra&scaron;yme skelbiama&nbsp;ne tik apie jo poreikius, bet ir apie jo gautus daiktus.<br />\r\nSuprantama, kad gali atsirasti stokojančiųjų, kurie gali reik&scaron;ti pretenzijas dėl jų asmens duomenų paskelbimo&nbsp;<strong>aukokdaiktus.lt</strong>tinkle,&nbsp;todėl kuratoriams, prijungiantiems prie tinklo naujus stokojančiuosius (fizinius asmenis), privaloma juos perspėti bei papra&scaron;yti sutikimo.</p>\r\n\r\n<p><span style="line-height:1.2em">#####Kas yra Kuratorius ir kaip juo tapti?###4###</span></p>\r\n\r\n<p>Kuratorius&nbsp;yra tarpininkas tarp&nbsp;<strong>aukokdaiktus.lt&nbsp;</strong>tinklo, dovanotojo ir stokojančiojo.&nbsp;Kuratoriumi&nbsp;<strong>aukokdaiktus.lt&nbsp;</strong>tinkle gali būti:</p>\r\n\r\n<ul>\r\n	<li>savivaldoje dirbantis socialinis darbuotojas, kuruojantis stokojančiuosius, gyvenančius jo savivaldos ribose;</li>\r\n	<li>ugdymo įstaigoje dirbantis socialinis pedagogas, kuruojantis moksleivius i&scaron; socialiai remtinų &scaron;eimų;</li>\r\n	<li>labdaros organizacijos savanoris, kuruojantis socialiai remtinus asmenis;</li>\r\n	<li>stokojančiojo<em>&ndash;</em>juridinio asmens vadovo įgaliotas&nbsp;organizacijos darbuotojas.</li>\r\n</ul>\r\n\r\n<p><span style="line-height:1.6em">Pagrindinės kuratoriaus funkcijos:</span></p>\r\n\r\n<ul>\r\n	<li>stokojančiųjų paie&scaron;ka, atranka ir&nbsp;jų kuravimas;</li>\r\n	<li>stokojančiojo poreikio įvedimas į&nbsp;<strong>aukokdaiktus.lt&nbsp;</strong>sistemą;</li>\r\n	<li>bendravimas su dovanotojais, jų daiktų pergabenimas stokojantiems;&nbsp;</li>\r\n	<li>ry&scaron;ių su savivaldybės socialinių tarnybų ir visuomeninių organizacijų atstovais palaikymas.</li>\r\n</ul>\r\n\r\n<p>Norint tapti Kuratoriumi, reikia kreiptis į Jūsų mieste ar apskrityje esančius<strong>&nbsp;aukokdaiktus.lt&nbsp;</strong><a href="http://www.aukokdaiktus.lt/mes-regionuose">Tinklo atstovus</a>. Jei tokių Jūsų apskrityje nėra&nbsp;<em>&ndash;</em>&nbsp;kreiptis į&nbsp;<a href="http://www.aukokdaiktus.lt/kontaktai">Tinklo administraciją</a>.</p>\r\n\r\n<p>#####Kas gali dovanoti?###5###</p>\r\n\r\n<p>Dovanotoju gali būti bet kuris fizinis asmuo. Juridiniai asmenys kol kas gali dovanoti tik fizinio asmens vardu.&nbsp;Vienąkart dovanoti galima neužsiregistravus, o dovanojant daugiau kartų rekomenduojama užsiregistruoti&nbsp;<strong>aukokdaiktus.lt</strong>&nbsp;tinklalapyje.</p>\r\n\r\n<p>#####Kaip perduoti paramą stokojančiajam?###6###</p>\r\n\r\n<p>Užregistravus&nbsp;<strong>aukokdaiktus.lt&nbsp;</strong>dovanojimą, kuratorius ir dovanotojas gauna vienas kito&nbsp;kontaktus. Kuratorius susisiekia su dovanotoju ir suorganizuoja daikto perdavimą stokojančiajam. Galimi dovanojamo daikto pergabenimo būdai:</p>\r\n\r\n<ul>\r\n	<li>dovanotojas pats perduoda&nbsp;paramą stokojančiajam (su kuratoriaus žinia);</li>\r\n	<li>dovanotojas perduoda daiktą kuratoriui, o &scaron;is&nbsp;<em>&ndash;</em>&nbsp;stokojančiajam;</li>\r\n	<li>stokojantysis pats perima daiktą i&scaron; dovanotojo (su kuratoriaus žinia);</li>\r\n	<li>pergabenimą suorganizuoja kuratorius, pasinaudodamas logistikos partnerių paslaugomis;</li>\r\n	<li>kuratorius&nbsp;<strong>aukokdaiktus.lt</strong>&nbsp;tinkle paslaugų kategorijoje skelbia&nbsp;padovanoto daikto pervežimo paslaugos poreikį.</li>\r\n</ul>\r\n', '2014-03-21 14:32:52', '0000-00-00 00:00:00', 3, 'duk', 1, 0),
