	(29, 0, 'Tapk pagalbos gavėju', '<h2>LEISK ŽINOTI APIE SAVO POREIKIUS NORINTIEMS TAU PADĖTI</h2>\r\n\r\n<p>Fiziniams asmenims &ndash; kreiptis į socialinį darbuotoją Jūsų gyvenamos vietos savivaldos administracijoje, informuoti jį apie <strong>aukoklaika.lt</strong> bei paskatinti kreiptis į Jūsų mieste ar apskrityje esančius <strong>aukoklaika.lt</strong> kuratorius bei tinklo atstovus. Jei tokių Jūsų apskrityje nėra &ndash; kreiptis į <a href="/kontaktai">tinklo komandą</a>.</p>\r\n\r\n<p>Juridiniams asmenims &ndash; kreiptis į Jūsų mieste ar apskrityje esančius <strong>aukoklaika.lt</strong> tinklo atstovus. Jei tokių Jūsų apskrityje nėra &ndash; kreiptis į <a href="/kontaktai">tinklo komandą</a>.</p>\r\n\r\n<table border="0" cellpadding="0" cellspacing="1" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="3" style="text-align:center">\r\n			<h2>Pagalbos darbais kategorijos</h2>\r\n\r\n			<p><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395915965_sakos.png" style="height:66px; width:503px" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:center; vertical-align:top; width:33%">\r\n			<h2 style="margin-top:0">Ilgalaikė</h2>\r\n\r\n			<p>(tęstinė, reguliari, ilgiau nei 2 sav.) savanorystė</p>\r\n			</td>\r\n			<td style="text-align:center; vertical-align:top; width:33%">\r\n			<h2 style="margin-top:0">Trumpalaikė</h2>\r\n\r\n			<p>Vienkartiniai arba iki 2 sav. savanori&scaron;ki darbai</p>\r\n			</td>\r\n			<td style="text-align:center; vertical-align:top; width:33%">\r\n			<h2 style="margin-top:0">Sos (kar&scaron;ti) darbai</h2>\r\n\r\n			<p>Darbai skirti netikėtų nelaimių ir įvykių padariniams likviduoti</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2014-03-27 12:26:09', '0000-00-00 00:00:00', 3, 'tapkg', 0, 0),
	(30, 0, 'Tapk pagalbos gavėju', '<h2>LEISK ŽINOTI APIE SAVO POREIKIUS NORINTIEMS TAU PADĖTI</h2>\r\n\r\n<p>Fiziniams asmenims &ndash; kreiptis į socialinį darbuotoją Jūsų gyvenamos vietos savivaldos administracijoje, informuoti jį apie <strong>aukokdaiktus.lt</strong> bei paskatinti kreiptis į Jūsų mieste ar apskrityje esančius<strong> aukokdaiktus.lt</strong> kuratorius bei tinklo atstovus. Jei tokių Jūsų apskrityje nėra &ndash; kreiptis į <a href="/kontaktai">tinklo komandą</a>.</p>\r\n\r\n<p>Juridiniams asmenims &ndash; kreiptis į Jūsų mieste ar apskrityje esančius <strong>aukokdaiktus.lt</strong> tinklo atstovus. Jei tokių Jūsų apskrityje nėra &ndash; kreiptis į<a href="/kontaktai"> tinklo komandą</a>.</p>\r\n', '2014-03-27 11:33:11', '0000-00-00 00:00:00', 3, 'tapkg', 1, 0),
	(31, 0, 'Tapk komandos nariu', '<h2>Ir tu gali tapti komandos nariu</h2>\r\n\r\n<p>Jei nori tapti <strong>aukoklaika.lt</strong> savanoriu, kreipkis naudodamasis kontaktų forma ir nurodyk, kurioje sferoje norėtum savanoriauti.</p>\r\n\r\n<table border="0" cellpadding="0" cellspacing="1" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="3" style="text-align:center">\r\n			<h2>Pagalbos darbais kategorijos</h2>\r\n\r\n			<p><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395923148_PD_updatedotherIcons-12.png" style="height:40px; width:41px" /></p>\r\n\r\n			<p><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395915965_sakos.png" style="height:66px; width:503px" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:center; vertical-align:middle; width:305px">\r\n			<h2 style="margin-top:0px">Tinklo atstovai</h2>\r\n			</td>\r\n			<td style="text-align:center; vertical-align:middle; width:305px">\r\n			<h2 style="margin-top:0px">Kuratoriai</h2>\r\n			</td>\r\n			<td style="text-align:center; vertical-align:middle; width:305px">\r\n			<h2 style="margin-top:0px">Funkcinės savanorių komandos</h2>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:center; vertical-align:top; width:305px">Tai žmonės, kurie yra atsakingi už <strong>aukoklaika.lt</strong> tinklo vystymą. Jie savo kra&scaron;te ie&scaron;ko savanorių kuratorių, juos apmoko, prijungia prie tinklo, bendrdarbiauja su vietos socialiniais darbuotojais, socialinės rūpybos įstaigomis.</td>\r\n			<td style="text-align:center; vertical-align:top; width:305px">Tai yra tarpininkaujantys tarp <strong>aukoklaika.lt </strong>tinklo, geradario ir pagalbos gavėjo. Jie ie&scaron;ko žmonių, kuriems reikalinga pagalba darbais, vykdo jų atranką, bendrauja su geradariais ir pagalbos gavėjais, organizuoja efektyvų ir kokybi&scaron;ką savanorių darbų atlikimą</td>\r\n			<td style="text-align:center; vertical-align:top; width:305px">Tai savanoriai, koordinuojantys viso tinklo veiklą ir atsakingi už tam tikras veiklos sritis (vie&scaron;inimas, logistika, darbas su savanoriais, IT darbai, partnerystė su verslu, projektų valdymas ir pan.)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2014-03-27 14:25:51', '0000-00-00 00:00:00', 3, 'tapk', 0, 0),
	(32, 0, 'Tapk komandos nariu', '<h2>Ir tu gali tapti komandos nariu</h2>\r\n\r\n<p>Jei nori tapti <strong>aukokdaiktus.lt</strong> savanoriu, kreipkis naudodamasis kontaktų forma ir nurodyk, kurioje sferoje norėtum savanoriauti.</p>\r\n\r\n<table border="0" cellpadding="0" cellspacing="1" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="3" style="text-align:center">\r\n			<h2>Pagalbos darbais kategorijos</h2>\r\n\r\n			<p><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395923114_PD_updatedotherIcons-27.png" style="height:41px; width:41px" /></p>\r\n\r\n			<p><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395920157_trisakismelynas.png" style="height:66px; width:503px" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:center; vertical-align:middle; width:305px">\r\n			<h2 style="margin-top:0px">Tinklo atstovai</h2>\r\n			</td>\r\n			<td style="text-align:center; vertical-align:middle; width:305px">\r\n			<h2 style="margin-top:0px">Kuratoriai</h2>\r\n			</td>\r\n			<td style="text-align:center; vertical-align:middle; width:305px">\r\n			<h2 style="margin-top:0px">Funkcinės savanorių komandos</h2>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align:center; vertical-align:top; width:305px">Tai žmonės, kurie yra atsakingi už <strong>aukokdaiktus.lt</strong> tinklo vystymą. Jie savo kra&scaron;te ie&scaron;ko savanorių kuratorių, juos apmoko, prijungia prie tinklo, bendrdarbiauja su vietos socialiniais darbuotojais, socialinės rūpybos įstaigomis.</td>\r\n			<td style="text-align:center; vertical-align:top; width:305px">Tai yra tarpininkaujantys tarp <strong>aukokdaiktus.lt</strong> tinklo, dovanotojo ir paramos gavėjo. Jie ie&scaron;ko žmonių, kuriems reikalinga pagalba darbais, vykdo jų atranką, bendrauja su dobanotojais ir paramos gavėjais, organizuoja efektyvų ir kokybi&scaron;ką savanorių darbų atlikimą</td>\r\n			<td style="text-align:center; vertical-align:top; width:305px">Tai savanoriai, koordinuojantys viso tinklo veiklą ir atsakingi už tam tikras veiklos sritis (vie&scaron;inimas, logistika, darbas su savanoriais, IT darbai, partnerystė su verslu, projektų valdymas ir pan.)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2014-03-27 14:25:18', '0000-00-00 00:00:00', 3, 'tapk', 1, 0),
	(33, 0, 'Padėk kitiems', '<table border="0" cellpadding="10" cellspacing="0" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align:center; vertical-align:top; width:33%">\r\n			<p><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395917869_PDAIKTAIS-kitosikonos-07.png" style="height:40px; width:41px" /></p>\r\n\r\n			<h2>Ie&scaron;kok</h2>\r\n\r\n			<p>ir sužinok, kam reikalinga pagalba, kurią Jūs galite suteikti. Ie&scaron;koti darbų poreikių galite pagal&nbsp;darbų kategorijas, gyvenamąją vietą ir pagalbos gavėjo tipą</p>\r\n			</td>\r\n			<td style="text-align:center; vertical-align:top; width:33%">\r\n			<p><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395917835_PDAIKTAIS-kitosikonos-08.png" style="height:40px; width:41px" /></p>\r\n\r\n			<h2>Susisiek</h2>\r\n\r\n			<p>užsiregistravęs <strong>aukokdaiktus.lt</strong>&nbsp;tinklapyje arba įvesk savo duomenis padedant vieną kartą</p>\r\n			</td>\r\n			<td style="text-align:center; vertical-align:top; width:33%">\r\n			<p><img alt="" src="http://www.aukoklaika.lt/uploads/ckeditor/1395917858_PDAIKTAIS-kitosikonos-09.png" style="height:40px; width:41px" /></p>\r\n\r\n			<h2>Padėk</h2>\r\n\r\n			<p>atlikdamas pasirinktą darbą</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Jei ketinate padėti ne vieną kartą, rekomenduojame užsiregistruoti <strong>aukokdaiktus.lt</strong>&nbsp;tinklapyje &ndash; taip pasirinkti kitus darbus bus greičiau ir patogiau. Registracijos metu reikia nurodyti savo asmens duomenis, slaptažodį, su kuriuo tuojau pat galėsite prisijungti. Įvedant duomenis dėl pagalbos reikia nurodyti savo asmens duomenis, susipažinti su <strong>aukokdaiktus.lt</strong>&nbsp;taisyklėmis, sutikti su jų turiniu bei jų laikytis.</p>\r\n\r\n<p>Smulkesnę informaciją, kaip atlikti pasirinktą darbą, Jums suteiks&nbsp;<strong>aukokdaiktus.lt</strong>&nbsp;kuratorius. Daugeliu atvejų skatinama susitikti ar pabendrauti trise: Jūs &ndash; geradarys, kuratorius ir pagalbos gavėjas, kad atliekant darbą nekiltų neai&scaron;kumų.</p>\r\n\r\n<p>Jeigu kiltų neai&scaron;kumų ar nesusipratimų&nbsp;<em>&ndash;</em>&nbsp;mes visuomet pasiruo&scaron;ę <a href="/kontaktai">Jums padėti</a>.</p>\r\n', '2014-03-27 12:58:32', '0000-00-00 00:00:00', 3, 'padek', 1, 0),
	(34, 0, 'Taisyklės', '<h2><strong>Gerumo tinklo aukokdaiktus.lt taisyklės</strong></h2>\r\n\r\n<p>&Scaron;is dokumentas yra sutartis tarp&nbsp;vie&scaron;osios įstaigos &bdquo;Geros valios projektai&ldquo;&nbsp;(toliau &ndash; Administratorius) ir Jūsų (toliau &ndash; Jūs arba Lankytojas)&nbsp;dėl naudojimosi interneto sistema aukokdaiktus.lt (toliau &ndash; PD) daiktų ir paslaugų gavimui bei dovanojimui ir visomis interneto svetainėje www.aukokdaiktus.lt (toliau &ndash; Svetainė) teikiamomis paslaugomis.</p>\r\n\r\n<p>Norėdami naudotis PD ar Svetainės pateikiamomis paslaugomis, Jūs privalote ne tik perskaityti žemiau i&scaron;dėstytas taisykles (toliau &ndash; Taisyklės), bet ir sutikti su jų turiniu bei jų laikytis. Pažymėdami &bdquo;sutinku&ldquo; Jūs patvirtinate, kad įdėmiai perskaitėte visas Taisykles, supratote jų turinį, be jokių i&scaron;lygų sutinkate su visomis jose i&scaron;dėstytomis sąlygomis ir įsipareigojate jų laikytis.</p>\r\n\r\n<h2><strong>Terminai</strong></h2>\r\n\r\n<p><strong>Taisyklės</strong>&nbsp;&ndash; rei&scaron;kia &scaron;į dokumentą bei informaciją, esančią Svetainės&nbsp;<a href="/duk">DUK</a>&nbsp;(dažniausiai užduodami klausimai) srityje ir pasiekiamą adresu&nbsp;<a href="/duk">http://www.aukokdaiktus.lt/duk</a>.</p>\r\n\r\n<p><strong>Tinklo atstovas</strong>&nbsp;&ndash;&nbsp;<strong>aukokdaiktus.lt</strong>&nbsp;tinklo savanoris, organizuojantis tinklo darbą.&nbsp;Tinkle gali būti po vieną vyresnįjį tinklo atstovą kiekviename Lietuvos Respublikos teritorijos administraciniame vienete ir neribotas skaičius tinklo atstovų. Pagrindinė jų pareiga &ndash; kuratorių paie&scaron;ka, jungimas prie tinklo, apmokymas, parama ir pan. Tinklo atstovų darbui organizuoti buriamos regioninės funkcinės savanorių komandos: Kuratorių paie&scaron;kos, Vie&scaron;inimo, Svetainės plėtros, Logistikos ir kt. Komandoms vadovauja komandų vadovai &ndash; savanoriai.</p>\r\n\r\n<p><strong>Kuratorius</strong>&nbsp;&ndash; Tinklo atstovo atrinktas žmogus, kuris ir yra tarpininkas tarp rėmėjo ir stokojančio. Kuratorius yra atsakingas už stokojančių atranką, jų poreikių i&scaron;gryninimą ir patalpinimą PD, už kontaktą su rėmėju dovanojimo ar jo pasiūlymo priėmimo atveju. Kuratorius turi suorganizuoti labdaros perdavimą. Kuratoriais gali būti socialinių įstaigų&nbsp;atstovai bei socialiniai darbuotojai, socialiniai pedagogai, asmenys, dirbantys su stokojančiaisiais.</p>\r\n\r\n<p><strong>Stokojantysis</strong>&nbsp;&ndash;&nbsp;labdaros gavėjas, kurio poreikiai skelbiami PD. Jais gali būti juridiniai ir fiziniai asmenys (kategorijas rasite punkte&bdquo;Stokojantieji (labdaros gavėjai)&rdquo;.</p>\r\n\r\n<p><strong>Dovanotojas</strong>&nbsp;&ndash;&nbsp;labdaros davėjas, Svetainės lankytojas, kuris Svetainėje radęs Stokojančiojo poreikį, jį patenkina. Dovanotoju gali būti tiek fizinis, tiek juridinis asmuo.</p>\r\n\r\n<p><strong>Labdara</strong>&nbsp;&ndash;&nbsp;daiktas ar paslauga, kurie yra reikalingi Stokojantiesiems ir kuriuos kaip&nbsp;poreikius registruoja PD Kuratorius.Labdarą Stokojantiesiems dovanoja Dovanotojai.</p>\r\n\r\n<h2><strong>Tinklo atstovai</strong></h2>\r\n\r\n<p>1. Tinklo atstovų funkcijos:</p>\r\n\r\n<ul>\r\n	<li>vykdyti Kuratorių atranką;</li>\r\n	<li>įvesti į PD naujus Kuratorius, apmokyti juos naudotis sistema;</li>\r\n	<li>komunikuoti su savo įvestais Kuratoriais ir PD vadovu;</li>\r\n	<li>prižiūrėti savo įvestų Kuratorių veiklos skaidrumą;</li>\r\n	<li>palaikyti ry&scaron;ius su savivaldyb<span dir="rtl">ės so</span>cialinių tarnybų ir visuomeninių organizacijų atstovais;</li>\r\n	<li>pagal poreikį vykdyti Kuratorių funkcijas.</li>\r\n</ul>\r\n\r\n<p>2. Reikalavimai Tinklo atstovams:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>psichologijos, sociologijos, socialinio darbo, pedagogikos, medicinos (arba pana&scaron;us su visuomenės pažinimu susijęs) i&scaron;silavinimas arba atitinkamo darbo patirtis;</li>\r\n	<li>kompiuterinis ra&scaron;tingumas;</li>\r\n	<li>sąžiningumas (nesuinteresuotumas pasinaudoti tarnybine padėtimi);</li>\r\n	<li>komunikabilumas;</li>\r\n	<li>turėti mobilųjį arba stacionarųjį telefoną, kuriuo būtų pasiekiamas dienos ir vakaro metu;</li>\r\n	<li>turėti interneto prieigą, el. pa&scaron;to adresą;</li>\r\n	<li>turėti vairuotojo pažymėjimą ir automobilį (privalumas);</li>\r\n	<li>gali pateikti jį rekomenduosiančių asmenų sąra&scaron;ą.</li>\r\n</ul>\r\n\r\n<p>3. Svarbu:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Tinklo&nbsp;atstovų kontaktiniai duomenys yra vie&scaron;i.</li>\r\n</ul>\r\n\r\n<h2>Kuratoriai</h2>\r\n\r\n<p>1. Kuratorių funkcijos:</p>\r\n\r\n<ul>\r\n	<li>vykdyti potencialių Stokojančiųjų atranką;</li>\r\n	<li>identifikuoti ir pateikti Stokojančiųjų poreikius PD;</li>\r\n	<li>PD pateikti tikslią ir savalaikę informaciją apie Stokojančiuosius ir jų poreikius;</li>\r\n	<li>padėti Stokojantiesiems surasti reikalingus daiktus ar paslaugas PD;</li>\r\n	<li>atsakyti už Dovanotojų suteiktos labdaros pristatymą savo kuruojamiems asmenims.</li>\r\n</ul>\r\n\r\n<p>2. Reikalavimai kuratoriams:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>psichologijos, sociologijos, socialinio darbo, pedagogikos, medicinos (arba pana&scaron;us su visuomenės pažinimu susijęs) i&scaron;silavinimas arba atitinkamo darbo patirtis;</li>\r\n	<li>kompiuterinis ra&scaron;tingumas;</li>\r\n	<li>noras padėti Stokojantiesiems;</li>\r\n	<li>sąžiningumas (nesuinteresuotumas pasinaudoti padėtimi);</li>\r\n	<li>komunikabilumas;</li>\r\n	<li>turėti mobilųjį arba stacionarųjį telefoną, kuriuo būtų pasiekiamas dienos ir vakaro metu;</li>\r\n	<li>turėti interneto prieigą, el. pa&scaron;to adresą;</li>\r\n	<li>turėti vairuotojo pažymėjimą ir automobilį (privalumas);</li>\r\n	<li>gali pateikti jį rekomenduosiančių asmenų sąra&scaron;ą.</li>\r\n</ul>\r\n\r\n<p>3. Svarbu:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Jei Stokojantysis yra juridinis asmuo, jo Kuratoriumi gali būti organizacijos vadovas arba jo paskirtas darbuotojas.</li>\r\n	<li>Kuratorių kontaktiniai duomenys yra vie&scaron;i.</li>\r\n	<li>Kuratorius, tardamasis su Dovanotoju dėl daikto pristatymo Stokojančiajam, siūlo vieną i&scaron; &scaron;ių alternatyvų:<br />\r\n	A. Dovanotojas pats pristato daiktą Stokojančiajam;<br />\r\n	B. Dovanotojas pristato daiktą Kuratoriui, kuri pats perduoda daiktą Stokojančiam;<br />\r\n	C. Kuratorius atsiima daiktą i&scaron; Dovanotojo;<br />\r\n	D. Skelbia pristatymo paslaugos poreikį PD.</li>\r\n</ul>\r\n\r\n<h2><strong>Stokojantieji (labdaros gavėjai)</strong></h2>\r\n\r\n<p>1. Stokojančiuoju gali būti:</p>\r\n\r\n<p>Fiziniai asmenys, gyvenantys žemiau skurdo ribos:</p>\r\n\r\n<ul>\r\n	<li>Daugiavaikė &scaron;eima;</li>\r\n	<li>Jauna &scaron;eima su vaiku (-ais);</li>\r\n	<li>Mažas pajamas turinti &scaron;eima;</li>\r\n	<li>&Scaron;eima, auginanti negalią turintį vaiką;</li>\r\n	<li>Vieni&scaron;as tėvas (mama);</li>\r\n	<li>Negalią turintis žmogus;</li>\r\n	<li>Priklausomybę nuo alkoholio turėjęs žmogus (po reabilitacijos) *;</li>\r\n	<li>Priklausomybę nuo narkotinių medžiagų turėjęs žmogus *;</li>\r\n	<li>Smurto auka *;</li>\r\n	<li>Pabėgėlis (-iai);</li>\r\n	<li>Na&scaron;laitė (-is);</li>\r\n	<li>Vieni&scaron;as senjoras;</li>\r\n	<li>Žmogus, atlikęs laisvės atėmimo bausmę *;</li>\r\n	<li>Žmogus, buvęs vaikų globos institucijoje;</li>\r\n	<li>Darbo netekęs žmogus;</li>\r\n	<li>Žmonės, per gaisrą netekę savo turto.</li>\r\n</ul>\r\n\r\n<p>* &ndash; atranką gali vykdyti tik profesionalūs socialiniai darbuotojai.</p>\r\n\r\n<p>Juridiniai asmenys:</p>\r\n\r\n<ul>\r\n	<li>Senjorų namai;</li>\r\n	<li>Vaikų globos institucija;</li>\r\n	<li>Vaiko ir motinos globos institucija;</li>\r\n	<li>Negalią turinčių žmonių globos institucija;</li>\r\n	<li>Socialinių paslaugų centras;</li>\r\n	<li>Reabilitacijos centras;</li>\r\n	<li>Pilietinė nevyriausybinė organizacija;</li>\r\n	<li>Pilietinė organizacija;</li>\r\n	<li>Bendruomenė.</li>\r\n</ul>\r\n\r\n<p>2. Stokojančiuoju tinkle teisės tapti neturi:</p>\r\n\r\n<ul>\r\n	<li>Mokyklos ir vaikų darželiai;</li>\r\n	<li>Komercine veikla užsiimančios įmonės;</li>\r\n	<li>Organizacijos, vienijančios tokį pat arba pana&scaron;ų pomėgį turinčius narius;</li>\r\n	<li>Žmonės, turintys priklausomybę alkoholiui ir/arba narkotikams;</li>\r\n	<li>Tie, kurie gavę paramą ją panaudojo netikslingai.</li>\r\n</ul>\r\n\r\n<p>3. Stokojančiojo duomenis ir poreikius PD skelbia Kuratorius.</p>\r\n\r\n<p>4. PD įsipareigoja neskelbti ir neplatinti Stokojančiojo ir/arba jo &scaron;eimos asmens duomenų siekiant kitokių tikslų nei rasti &scaron;iam žmogui ir /arba jo &scaron;eimai pagalbą.</p>\r\n\r\n<h2><strong>Dovanotojai (dovanojimo taisyklės)</strong></h2>\r\n\r\n<ol>\r\n	<li>Svetainės Lankytojai (potencialūs dovanotojai), norintys pasiūlyti savo daiktą ar paslaugą stokojantiems, gali naudotis Svetainės paie&scaron;ka tam, kad surastų, kuriems PD registruotiems Stokojantiesiems reikia būtent tokio daikto ar paslaugos.</li>\r\n	<li>Dovanotojas, paspausdamas mygtuką &bdquo;Dovanoju&ldquo;,&nbsp;patvirtina, kad turi galimybę jį neatlygintinai dovanoti, ir&nbsp;įsipareigoja:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Užtikrinti, kad dovanojamas daiktas yra dar naudojamas ir atitinka pasirinktą poreikį;</li>\r\n	<li>Susisiekti su Stokojančiojo Kuratoriumi;</li>\r\n	<li>Padėti Kuratoriui organizuoti dovanojamo daikto perdavimą Stokojančiajam;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Administratorius turi teisę:</strong></h2>\r\n\r\n<ol>\r\n	<li>Bet kuriuo metu i&scaron; dalies arba visi&scaron;kai keisti &scaron;ias taisykles prane&scaron;dami apie tai www.aukokdaiktus.lt Svetainėje. Jei Jūs naudositės www.aukokdaiktus.lt Svetaine po to, kai pakeitimai bus atlikti, tai reik&scaron;, kad Jūs su jais sutinkate. Jei Jūs nesutinkate su pakeistomis Taisyklėmis, Jūs prarandate teisę naudotis PD ir Svetaine;</li>\r\n	<li>Atrinkti Tinklo atstovus, kurie savanori&scaron;kai dirbs su PD ir Svetaine;</li>\r\n	<li>Leisti arba neleisti bet kuriam potencialiam savanoriui dalyvauti gerumo tinklo&nbsp;<strong>aukokdaiktus.lt</strong>&nbsp;veikloje, nenurodant jokių priežasčių ir nepateikiant paai&scaron;kinimų;</li>\r\n	<li>Bet kada, be i&scaron;ankstinio įspėjimo apriboti arba sustabdyti Jūsų galimybę naudotis PD &nbsp;ir/ar Svetaine;</li>\r\n	<li>Bet kuriuo metu viena&scaron;ali&scaron;kai, savo nuožiūra ir neprane&scaron;ęs apie tai Jums panaikinti visą ar dalį Jūsų prisijungimo duomenų, o taip pat ir kitokią informaciją, kurią Jūs bet kokiu būdu pateikėte Administratoriui naudodamasis PD ar Svetaine, ją keisti, apriboti galimybes arba uždrausti Jums naudotis visomis arba dalimi PD funkcijų ir/ar pasiekti Svetainę;</li>\r\n	<li>Bet kada, neprane&scaron;ęs Jums, nutraukti PD paslaugų teikimą, keisti PD ir/ar Svetainę ar atskiras jų dalis, visą ir bet kokį jų turinį. Jūs suprantate ir sutinkate, kad Administratorius niekada nebus laikomas atsakingu už jokius tokiais veiksmais sukeltus neigiamus padarinius Jums;</li>\r\n	<li>Visas ar bet kurią dalį paslaugų pradėti teikti už užmokestį arba pradėti teikti nemokamai;</li>\r\n	<li>Spręsti dėl prijungiamų Stokojančiųjų bei jų Poreikių tinkamumo PD bei leisti arba neleisti jų talpinti PD;</li>\r\n	<li>Tvarkyti PD dalyvaujančių asmenų (Tinklo atstovų, Kuratorių, Stokojančiųjų ir Rėmėjų) asmens duomenis nekomerciniais ir tik &scaron;iose taisyklėse apibrėžtais tikslais;</li>\r\n	<li>Dalintis PD dalyvaujančių asmenų asmens duomenimis su PD technologiniais partneriais &scaron;iose taisyklėse apibrėžtais tikslais;</li>\r\n	<li>Bet kada nutraukti PD veiklą, apie tai prie&scaron; 10 kalendorinių dienų elektroniniu pa&scaron;tu prane&scaron;ęs PD registruotiems asmenims;</li>\r\n	<li>Bet kokia forma, būdu ir tikslais atgaminti, i&scaron;leisti, vie&scaron;ai skelbti, padaryti vie&scaron;ai prieinamu ir platinti parduodant, nuomojant, teikiant panaudai ar kitaip perduodant nuosavybėn arba valdyti Jūsų pateiktą informaciją ir/ar kūrinius bet kokia forma ar kalba, o taip pat teisę kurti i&scaron;vestinius kūrinius i&scaron; Jūsų pateiktos informacijos ar kūrinių.</li>\r\n</ol>\r\n\r\n<h2><strong>Force majeure</strong></h2>\r\n\r\n<ol>\r\n	<li>Nei vienas i&scaron; PD dalyvių (Administratorius, Tinklo atstovai, Kuratoriai, Stokojantieji ir Rėmėjai) neatsako už įsipareigojimų nevykdymą, jei jis bus potvynio, gaisro, žemės drebėjimo, kitų stichinių nelaimių, epidemijų, karinių veiksmų, valstybės valdžios ar valdymo organų veiksmų ir aktų pasekmė.</li>\r\n	<li>Bet kuris PD dalyvis, kuris dėl nurodytų aplinkybių negali vykdyti prisiimtų įsipareigojimų, per penkias darbo dienas privalo el. lai&scaron;ku apie tai informuoti Administratorių.</li>\r\n	<li>Jei Administratorius dėl nurodytų aplinkybių negali vykdyti prisiimtų įsipareigojimų, per penkias darbo dienas privalo el. lai&scaron;ku apie tai informuoti kitus PD dalyvius.</li>\r\n</ol>\r\n\r\n<h2><strong>Jūsų atsakomybė</strong></h2>\r\n\r\n<ol>\r\n	<li>Jūs sutinkate, kad Administratorius nėra ir nebus atsakingas už Svetainės ir/ar PD veikimo sutrikimus ir dėl to Jūsų ar trečiųjų asmenų patirtus nuostolius ar žalą.</li>\r\n	<li>Jūs suprantate ir sutinkate su tuo, kad Svetainė ir PD pateikiamos be jokių patvirtinimų ar garantijų i&scaron; Administratoriaus pusės, jog Svetainė ir/ar PD veiks ir paslaugos bus teikiamos tinkamai ir laiku, be sutrikimų, kokybi&scaron;kai, pilna apimtimi arba, kad tai nesukels jokių neigiamų pasekmių Jums ar tretiesiems asmenims. Administratorius nėra ir nebus atsakingas už PD ir/ar Svetainėje esančius neatitikimus, informacijos netikslumą ar klaidingumą ir i&scaron; to kilusias neigiamas pasekmes Jums ar tretiesiems asmenimis.</li>\r\n	<li>Administratorius negarantuoja, kad PD ir/ar Svetainė veiks nepertraukiamai ir be klaidų, kad paslaugų sutrikimai bus nedelsiant i&scaron;taisyti ar kad Svetainėje prieinamas turinys bus apsaugotas nuo virusų, kitokios kenksmingos ar nepageidautinos programinės įrangos bei kitų kenksmingų dalykų.</li>\r\n	<li>Jūs suprantate ir sutinkate, kad Administratorius niekada ir dėl jokių priežasčių nebus atsakingas už visus ir bet kuriuos savo veiksmus arba neveikimą susijusį su Jūsų naudojimusi PD ir/ar Svetaine ir &scaron;ių Taisyklių laikymusi. Jūs prisiimate visą atsakomybę dėl bet kokio pobūdžio žalos ar nuostolių atlyginimo, kurie jam ar tretiesiems asmenims gali atsirasti bet kokiu būdu Jums naudojantis Svetaine ir/ar PD.</li>\r\n	<li>Jūs įsipareigojate užtikrinti, kad Administratoriui niekada nekiltų jokia teisinė atsakomybė, pareiga apmokėti, atlyginti ar kitaip kompensuoti bet kokius nuostolius, žalą ar kitokias i&scaron;laidas, atsiradusias dėl to, kad Jūs naudojotės Svetaine ir/ar PD.</li>\r\n</ol>\r\n\r\n<h2><strong>Informacijos pateikimas</strong></h2>\r\n\r\n<ol>\r\n	<li>Administratorius visus prane&scaron;imus, reikalavimus, pra&scaron;ymus ir kitą informaciją siunčia Jums prisijungimo duomenyse jo nurodytu elektroninio pa&scaron;to adresu. Visa pagal &scaron;ias Taisykles Jums siunčiama informacija laikoma gauta praėjus trims valandoms nuo jos i&scaron;siuntimo momento.</li>\r\n	<li>Administratorius neatsako už bet kokius ir visus internetinio ry&scaron;io, elektroninio pa&scaron;to paslaugų tiekėjų tinklų sutrikimus, dėl kurių Jūs negaunate informacinių ar patvirtinančių elektroninių lai&scaron;kų i&scaron; Administratoriaus. &Scaron;alys susitaria, kad Jums skirto elektroninio lai&scaron;ko kopijos buvimas Administratoriaus serveryje yra tinkamas įrodymas apie bet kokios informacijos Jums i&scaron;siuntimą.</li>\r\n	<li>Visus prane&scaron;imus, reikalavimus, pra&scaron;ymus ir klausimus Jūs siunčiate naudodamiesi Svetainės skyriuje &bdquo;Kontaktai&ldquo; esančia kontaktų forma.</li>\r\n</ol>\r\n\r\n<h2><strong>Kita</strong></h2>\r\n\r\n<ol>\r\n	<li>&Scaron;ioms Taisyklėms yra taikoma Lietuvos Respublikos teisė. Visi tarp Jūsų ir Administratoriaus kilę nesutarimai dėl &scaron;ių Taisyklių vykdymo yra sprendžiami derybų keliu. &Scaron;alims nei&scaron;sprendus ginčo derybų būdu per 15 (penkiolika) dienų nuo tos dienos, kai viena i&scaron; &scaron;alių įteikė kitai &scaron;aliai pra&scaron;ymą i&scaron;spręsti ginčą, toks ginčas galutinai sprendžiamas Lietuvos Respublikos įstatymų nustatyta tvarka teismuose, pagal Administratoriaus buveinės vietą.</li>\r\n	<li>&Scaron;alys susitaria, jog Administratorius gali bet kuriuo metu perleisti savo teises ir pareigas, kylančias i&scaron; &scaron;ių Taisyklių tretiesiems asmenims be Jūsų sutikimo ir Jums apie tai neprane&scaron;ęs.</li>\r\n</ol>\r\n', '2014-03-25 09:51:24', '0000-00-00 00:00:00', 3, 'taisykles', 1, 0),
	(35, 0, 'Taisyklės', '<h2><strong>Gerumo tinklo aukoklaika.lt taisyklės</strong></h2>\r\n\r\n<p>&Scaron;is dokumentas yra sutartis tarp&nbsp;vie&scaron;osios įstaigos &bdquo;Geros valios projektai&ldquo;&nbsp;(toliau &ndash; Administratorius) ir Jūsų (toliau &ndash; Jūs arba Lankytojas)&nbsp;dėl naudojimosi interneto sistema aukoklaika.lt (toliau &ndash; PD) daiktų ir paslaugų gavimui bei dovanojimui ir visomis interneto svetainėje www.aukoklaika.lt (toliau &ndash; Svetainė) teikiamomis paslaugomis.</p>\r\n\r\n<p>Norėdami naudotis PD ar Svetainės pateikiamomis paslaugomis, Jūs privalote ne tik perskaityti žemiau i&scaron;dėstytas taisykles (toliau &ndash; Taisyklės), bet ir sutikti su jų turiniu bei jų laikytis. Pažymėdami &bdquo;sutinku&ldquo; Jūs patvirtinate, kad įdėmiai perskaitėte visas Taisykles, supratote jų turinį, be jokių i&scaron;lygų sutinkate su visomis jose i&scaron;dėstytomis sąlygomis ir įsipareigojate jų laikytis.</p>\r\n\r\n<h2><strong>Terminai</strong></h2>\r\n\r\n<p><strong>Taisyklės</strong>&nbsp;&ndash; rei&scaron;kia &scaron;į dokumentą bei informaciją, esančią Svetainės&nbsp;<a href="/duk">DUK</a>&nbsp;(dažniausiai užduodami klausimai) srityje ir pasiekiamą adresu <a href="/duk">http://www.aukoklaika.lt/duk</a>.</p>\r\n\r\n<p><strong>Tinklo atstovas</strong>&nbsp;&ndash;&nbsp;<strong>aukokdaiktus.lt</strong>&nbsp;tinklo savanoris, organizuojantis tinklo darbą.&nbsp;Tinkle gali būti po vieną vyresnįjį tinklo atstovą kiekviename Lietuvos Respublikos teritorijos administraciniame vienete ir neribotas skaičius tinklo atstovų. Pagrindinė jų pareiga &ndash; kuratorių paie&scaron;ka, jungimas prie tinklo, apmokymas, parama ir pan. Tinklo atstovų darbui organizuoti buriamos regioninės funkcinės savanorių komandos: Kuratorių paie&scaron;kos, Vie&scaron;inimo, Svetainės plėtros, Logistikos ir kt. Komandoms vadovauja komandų vadovai &ndash; savanoriai.</p>\r\n\r\n<p><strong>Kuratorius</strong>&nbsp;&ndash; Tinklo atstovo atrinktas žmogus, kuris ir yra tarpininkas tarp rėmėjo ir stokojančio. Kuratorius yra atsakingas už stokojančių atranką, jų poreikių i&scaron;gryninimą ir patalpinimą PD, už kontaktą su rėmėju dovanojimo ar jo pasiūlymo priėmimo atveju. Kuratorius turi suorganizuoti labdaros perdavimą. Kuratoriais gali būti socialinių įstaigų&nbsp;atstovai bei socialiniai darbuotojai, socialiniai pedagogai, asmenys, dirbantys su stokojančiaisiais.</p>\r\n\r\n<p><strong>Stokojantysis</strong>&nbsp;&ndash;&nbsp;labdaros gavėjas, kurio poreikiai skelbiami PD. Jais gali būti juridiniai ir fiziniai asmenys (kategorijas rasite punkte&bdquo;Stokojantieji (labdaros gavėjai)&rdquo;.</p>\r\n\r\n<p><strong>Dovanotojas</strong>&nbsp;&ndash;&nbsp;labdaros davėjas, Svetainės lankytojas, kuris Svetainėje radęs Stokojančiojo poreikį, jį patenkina. Dovanotoju gali būti tiek fizinis, tiek juridinis asmuo.</p>\r\n\r\n<p><strong>Labdara</strong>&nbsp;&ndash;&nbsp;daiktas ar paslauga, kurie yra reikalingi Stokojantiesiems ir kuriuos kaip&nbsp;poreikius registruoja PD Kuratorius.Labdarą Stokojantiesiems dovanoja Dovanotojai.</p>\r\n\r\n<h2><strong>Tinklo atstovai</strong></h2>\r\n\r\n<p>1. Tinklo atstovų funkcijos:</p>\r\n\r\n<ul>\r\n	<li>vykdyti Kuratorių atranką;</li>\r\n	<li>įvesti į PD naujus Kuratorius, apmokyti juos naudotis sistema;</li>\r\n	<li>komunikuoti su savo įvestais Kuratoriais ir PD vadovu;</li>\r\n	<li>prižiūrėti savo įvestų Kuratorių veiklos skaidrumą;</li>\r\n	<li>palaikyti ry&scaron;ius su savivaldyb<span dir="rtl">ės so</span>cialinių tarnybų ir visuomeninių organizacijų atstovais;</li>\r\n	<li>pagal poreikį vykdyti Kuratorių funkcijas.</li>\r\n</ul>\r\n\r\n<p>2. Reikalavimai Tinklo atstovams:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>psichologijos, sociologijos, socialinio darbo, pedagogikos, medicinos (arba pana&scaron;us su visuomenės pažinimu susijęs) i&scaron;silavinimas arba atitinkamo darbo patirtis;</li>\r\n	<li>kompiuterinis ra&scaron;tingumas;</li>\r\n	<li>sąžiningumas (nesuinteresuotumas pasinaudoti tarnybine padėtimi);</li>\r\n	<li>komunikabilumas;</li>\r\n	<li>turėti mobilųjį arba stacionarųjį telefoną, kuriuo būtų pasiekiamas dienos ir vakaro metu;</li>\r\n	<li>turėti interneto prieigą, el. pa&scaron;to adresą;</li>\r\n	<li>turėti vairuotojo pažymėjimą ir automobilį (privalumas);</li>\r\n	<li>gali pateikti jį rekomenduosiančių asmenų sąra&scaron;ą.</li>\r\n</ul>\r\n\r\n<p>3. Svarbu:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Tinklo&nbsp;atstovų kontaktiniai duomenys yra vie&scaron;i.</li>\r\n</ul>\r\n\r\n<h2>Kuratoriai</h2>\r\n\r\n<p>1. Kuratorių funkcijos:</p>\r\n\r\n<ul>\r\n	<li>vykdyti potencialių Stokojančiųjų atranką;</li>\r\n	<li>identifikuoti ir pateikti Stokojančiųjų poreikius PD;</li>\r\n	<li>PD pateikti tikslią ir savalaikę informaciją apie Stokojančiuosius ir jų poreikius;</li>\r\n	<li>padėti Stokojantiesiems surasti reikalingus daiktus ar paslaugas PD;</li>\r\n	<li>atsakyti už Dovanotojų suteiktos labdaros pristatymą savo kuruojamiems asmenims.</li>\r\n</ul>\r\n\r\n<p>2. Reikalavimai kuratoriams:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>psichologijos, sociologijos, socialinio darbo, pedagogikos, medicinos (arba pana&scaron;us su visuomenės pažinimu susijęs) i&scaron;silavinimas arba atitinkamo darbo patirtis;</li>\r\n	<li>kompiuterinis ra&scaron;tingumas;</li>\r\n	<li>noras padėti Stokojantiesiems;</li>\r\n	<li>sąžiningumas (nesuinteresuotumas pasinaudoti padėtimi);</li>\r\n	<li>komunikabilumas;</li>\r\n	<li>turėti mobilųjį arba stacionarųjį telefoną, kuriuo būtų pasiekiamas dienos ir vakaro metu;</li>\r\n	<li>turėti interneto prieigą, el. pa&scaron;to adresą;</li>\r\n	<li>turėti vairuotojo pažymėjimą ir automobilį (privalumas);</li>\r\n	<li>gali pateikti jį rekomenduosiančių asmenų sąra&scaron;ą.</li>\r\n</ul>\r\n\r\n<p>3. Svarbu:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Jei Stokojantysis yra juridinis asmuo, jo Kuratoriumi gali būti organizacijos vadovas arba jo paskirtas darbuotojas.</li>\r\n	<li>Kuratorių kontaktiniai duomenys yra vie&scaron;i.</li>\r\n	<li>Kuratorius, tardamasis su Dovanotoju dėl daikto pristatymo Stokojančiajam, siūlo vieną i&scaron; &scaron;ių alternatyvų:<br />\r\n	A. Dovanotojas pats pristato daiktą Stokojančiajam;<br />\r\n	B. Dovanotojas pristato daiktą Kuratoriui, kuri pats perduoda daiktą Stokojančiam;<br />\r\n	C. Kuratorius atsiima daiktą i&scaron; Dovanotojo;<br />\r\n	D. Skelbia pristatymo paslaugos poreikį PD.</li>\r\n</ul>\r\n\r\n<h2><strong>Stokojantieji (labdaros gavėjai)</strong></h2>\r\n\r\n<p>1. Stokojančiuoju gali būti:</p>\r\n\r\n<p>Fiziniai asmenys, gyvenantys žemiau skurdo ribos:</p>\r\n\r\n<ul>\r\n	<li>Daugiavaikė &scaron;eima;</li>\r\n	<li>Jauna &scaron;eima su vaiku (-ais);</li>\r\n	<li>Mažas pajamas turinti &scaron;eima;</li>\r\n	<li>&Scaron;eima, auginanti negalią turintį vaiką;</li>\r\n	<li>Vieni&scaron;as tėvas (mama);</li>\r\n	<li>Negalią turintis žmogus;</li>\r\n	<li>Priklausomybę nuo alkoholio turėjęs žmogus (po reabilitacijos) *;</li>\r\n	<li>Priklausomybę nuo narkotinių medžiagų turėjęs žmogus *;</li>\r\n	<li>Smurto auka *;</li>\r\n	<li>Pabėgėlis (-iai);</li>\r\n	<li>Na&scaron;laitė (-is);</li>\r\n	<li>Vieni&scaron;as senjoras;</li>\r\n	<li>Žmogus, atlikęs laisvės atėmimo bausmę *;</li>\r\n	<li>Žmogus, buvęs vaikų globos institucijoje;</li>\r\n	<li>Darbo netekęs žmogus;</li>\r\n	<li>Žmonės, per gaisrą netekę savo turto.</li>\r\n</ul>\r\n\r\n<p>* &ndash; atranką gali vykdyti tik profesionalūs socialiniai darbuotojai.</p>\r\n\r\n<p>Juridiniai asmenys:</p>\r\n\r\n<ul>\r\n	<li>Senjorų namai;</li>\r\n	<li>Vaikų globos institucija;</li>\r\n	<li>Vaiko ir motinos globos institucija;</li>\r\n	<li>Negalią turinčių žmonių globos institucija;</li>\r\n	<li>Socialinių paslaugų centras;</li>\r\n	<li>Reabilitacijos centras;</li>\r\n	<li>Pilietinė nevyriausybinė organizacija;</li>\r\n	<li>Pilietinė organizacija;</li>\r\n	<li>Bendruomenė.</li>\r\n</ul>\r\n\r\n<p>2. Stokojančiuoju tinkle teisės tapti neturi:</p>\r\n\r\n<ul>\r\n	<li>Mokyklos ir vaikų darželiai;</li>\r\n	<li>Komercine veikla užsiimančios įmonės;</li>\r\n	<li>Organizacijos, vienijančios tokį pat arba pana&scaron;ų pomėgį turinčius narius;</li>\r\n	<li>Žmonės, turintys priklausomybę alkoholiui ir/arba narkotikams;</li>\r\n	<li>Tie, kurie gavę paramą ją panaudojo netikslingai.</li>\r\n</ul>\r\n\r\n<p>3. Stokojančiojo duomenis ir poreikius PD skelbia Kuratorius.</p>\r\n\r\n<p>4. PD įsipareigoja neskelbti ir neplatinti Stokojančiojo ir/arba jo &scaron;eimos asmens duomenų siekiant kitokių tikslų nei rasti &scaron;iam žmogui ir /arba jo &scaron;eimai pagalbą.</p>\r\n\r\n<h2><strong>Dovanotojai (dovanojimo taisyklės)</strong></h2>\r\n\r\n<ol>\r\n	<li>Svetainės Lankytojai (potencialūs dovanotojai), norintys pasiūlyti savo daiktą ar paslaugą stokojantiems, gali naudotis Svetainės paie&scaron;ka tam, kad surastų, kuriems PD registruotiems Stokojantiesiems reikia būtent tokio daikto ar paslaugos.</li>\r\n	<li>Dovanotojas, paspausdamas mygtuką &bdquo;Dovanoju&ldquo;,&nbsp;patvirtina, kad turi galimybę jį neatlygintinai dovanoti, ir&nbsp;įsipareigoja:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Užtikrinti, kad dovanojamas daiktas yra dar naudojamas ir atitinka pasirinktą poreikį;</li>\r\n	<li>Susisiekti su Stokojančiojo Kuratoriumi;</li>\r\n	<li>Padėti Kuratoriui organizuoti dovanojamo daikto perdavimą Stokojančiajam;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Administratorius turi teisę:</strong></h2>\r\n\r\n<ol>\r\n	<li>Bet kuriuo metu i&scaron; dalies arba visi&scaron;kai keisti &scaron;ias taisykles prane&scaron;dami apie tai www.aukokdaiktus.lt Svetainėje. Jei Jūs naudositės www.aukokdaiktus.lt Svetaine po to, kai pakeitimai bus atlikti, tai reik&scaron;, kad Jūs su jais sutinkate. Jei Jūs nesutinkate su pakeistomis Taisyklėmis, Jūs prarandate teisę naudotis PD ir Svetaine;</li>\r\n	<li>Atrinkti Tinklo atstovus, kurie savanori&scaron;kai dirbs su PD ir Svetaine;</li>\r\n	<li>Leisti arba neleisti bet kuriam potencialiam savanoriui dalyvauti gerumo tinklo&nbsp;<strong>aukokdaiktus.lt</strong>&nbsp;veikloje, nenurodant jokių priežasčių ir nepateikiant paai&scaron;kinimų;</li>\r\n	<li>Bet kada, be i&scaron;ankstinio įspėjimo apriboti arba sustabdyti Jūsų galimybę naudotis PD &nbsp;ir/ar Svetaine;</li>\r\n	<li>Bet kuriuo metu viena&scaron;ali&scaron;kai, savo nuožiūra ir neprane&scaron;ęs apie tai Jums panaikinti visą ar dalį Jūsų prisijungimo duomenų, o taip pat ir kitokią informaciją, kurią Jūs bet kokiu būdu pateikėte Administratoriui naudodamasis PD ar Svetaine, ją keisti, apriboti galimybes arba uždrausti Jums naudotis visomis arba dalimi PD funkcijų ir/ar pasiekti Svetainę;</li>\r\n	<li>Bet kada, neprane&scaron;ęs Jums, nutraukti PD paslaugų teikimą, keisti PD ir/ar Svetainę ar atskiras jų dalis, visą ir bet kokį jų turinį. Jūs suprantate ir sutinkate, kad Administratorius niekada nebus laikomas atsakingu už jokius tokiais veiksmais sukeltus neigiamus padarinius Jums;</li>\r\n	<li>Visas ar bet kurią dalį paslaugų pradėti teikti už užmokestį arba pradėti teikti nemokamai;</li>\r\n	<li>Spręsti dėl prijungiamų Stokojančiųjų bei jų Poreikių tinkamumo PD bei leisti arba neleisti jų talpinti PD;</li>\r\n	<li>Tvarkyti PD dalyvaujančių asmenų (Tinklo atstovų, Kuratorių, Stokojančiųjų ir Rėmėjų) asmens duomenis nekomerciniais ir tik &scaron;iose taisyklėse apibrėžtais tikslais;</li>\r\n	<li>Dalintis PD dalyvaujančių asmenų asmens duomenimis su PD technologiniais partneriais &scaron;iose taisyklėse apibrėžtais tikslais;</li>\r\n	<li>Bet kada nutraukti PD veiklą, apie tai prie&scaron; 10 kalendorinių dienų elektroniniu pa&scaron;tu prane&scaron;ęs PD registruotiems asmenims;</li>\r\n	<li>Bet kokia forma, būdu ir tikslais atgaminti, i&scaron;leisti, vie&scaron;ai skelbti, padaryti vie&scaron;ai prieinamu ir platinti parduodant, nuomojant, teikiant panaudai ar kitaip perduodant nuosavybėn arba valdyti Jūsų pateiktą informaciją ir/ar kūrinius bet kokia forma ar kalba, o taip pat teisę kurti i&scaron;vestinius kūrinius i&scaron; Jūsų pateiktos informacijos ar kūrinių.</li>\r\n</ol>\r\n\r\n<h2><strong>Force majeure</strong></h2>\r\n\r\n<ol>\r\n	<li>Nei vienas i&scaron; PD dalyvių (Administratorius, Tinklo atstovai, Kuratoriai, Stokojantieji ir Rėmėjai) neatsako už įsipareigojimų nevykdymą, jei jis bus potvynio, gaisro, žemės drebėjimo, kitų stichinių nelaimių, epidemijų, karinių veiksmų, valstybės valdžios ar valdymo organų veiksmų ir aktų pasekmė.</li>\r\n	<li>Bet kuris PD dalyvis, kuris dėl nurodytų aplinkybių negali vykdyti prisiimtų įsipareigojimų, per penkias darbo dienas privalo el. lai&scaron;ku apie tai informuoti Administratorių.</li>\r\n	<li>Jei Administratorius dėl nurodytų aplinkybių negali vykdyti prisiimtų įsipareigojimų, per penkias darbo dienas privalo el. lai&scaron;ku apie tai informuoti kitus PD dalyvius.</li>\r\n</ol>\r\n\r\n<h2><strong>Jūsų atsakomybė</strong></h2>\r\n\r\n<ol>\r\n	<li>Jūs sutinkate, kad Administratorius nėra ir nebus atsakingas už Svetainės ir/ar PD veikimo sutrikimus ir dėl to Jūsų ar trečiųjų asmenų patirtus nuostolius ar žalą.</li>\r\n	<li>Jūs suprantate ir sutinkate su tuo, kad Svetainė ir PD pateikiamos be jokių patvirtinimų ar garantijų i&scaron; Administratoriaus pusės, jog Svetainė ir/ar PD veiks ir paslaugos bus teikiamos tinkamai ir laiku, be sutrikimų, kokybi&scaron;kai, pilna apimtimi arba, kad tai nesukels jokių neigiamų pasekmių Jums ar tretiesiems asmenims. Administratorius nėra ir nebus atsakingas už PD ir/ar Svetainėje esančius neatitikimus, informacijos netikslumą ar klaidingumą ir i&scaron; to kilusias neigiamas pasekmes Jums ar tretiesiems asmenimis.</li>\r\n	<li>Administratorius negarantuoja, kad PD ir/ar Svetainė veiks nepertraukiamai ir be klaidų, kad paslaugų sutrikimai bus nedelsiant i&scaron;taisyti ar kad Svetainėje prieinamas turinys bus apsaugotas nuo virusų, kitokios kenksmingos ar nepageidautinos programinės įrangos bei kitų kenksmingų dalykų.</li>\r\n	<li>Jūs suprantate ir sutinkate, kad Administratorius niekada ir dėl jokių priežasčių nebus atsakingas už visus ir bet kuriuos savo veiksmus arba neveikimą susijusį su Jūsų naudojimusi PD ir/ar Svetaine ir &scaron;ių Taisyklių laikymusi. Jūs prisiimate visą atsakomybę dėl bet kokio pobūdžio žalos ar nuostolių atlyginimo, kurie jam ar tretiesiems asmenims gali atsirasti bet kokiu būdu Jums naudojantis Svetaine ir/ar PD.</li>\r\n	<li>Jūs įsipareigojate užtikrinti, kad Administratoriui niekada nekiltų jokia teisinė atsakomybė, pareiga apmokėti, atlyginti ar kitaip kompensuoti bet kokius nuostolius, žalą ar kitokias i&scaron;laidas, atsiradusias dėl to, kad Jūs naudojotės Svetaine ir/ar PD.</li>\r\n</ol>\r\n\r\n<h2><strong>Informacijos pateikimas</strong></h2>\r\n\r\n<ol>\r\n	<li>Administratorius visus prane&scaron;imus, reikalavimus, pra&scaron;ymus ir kitą informaciją siunčia Jums prisijungimo duomenyse jo nurodytu elektroninio pa&scaron;to adresu. Visa pagal &scaron;ias Taisykles Jums siunčiama informacija laikoma gauta praėjus trims valandoms nuo jos i&scaron;siuntimo momento.</li>\r\n	<li>Administratorius neatsako už bet kokius ir visus internetinio ry&scaron;io, elektroninio pa&scaron;to paslaugų tiekėjų tinklų sutrikimus, dėl kurių Jūs negaunate informacinių ar patvirtinančių elektroninių lai&scaron;kų i&scaron; Administratoriaus. &Scaron;alys susitaria, kad Jums skirto elektroninio lai&scaron;ko kopijos buvimas Administratoriaus serveryje yra tinkamas įrodymas apie bet kokios informacijos Jums i&scaron;siuntimą.</li>\r\n	<li>Visus prane&scaron;imus, reikalavimus, pra&scaron;ymus ir klausimus Jūs siunčiate naudodamiesi Svetainės skyriuje &bdquo;Kontaktai&ldquo; esančia kontaktų forma.</li>\r\n</ol>\r\n\r\n<h2><strong>Kita</strong></h2>\r\n\r\n<ol>\r\n	<li>&Scaron;ioms Taisyklėms yra taikoma Lietuvos Respublikos teisė. Visi tarp Jūsų ir Administratoriaus kilę nesutarimai dėl &scaron;ių Taisyklių vykdymo yra sprendžiami derybų keliu. &Scaron;alims nei&scaron;sprendus ginčo derybų būdu per 15 (penkiolika) dienų nuo tos dienos, kai viena i&scaron; &scaron;alių įteikė kitai &scaron;aliai pra&scaron;ymą i&scaron;spręsti ginčą, toks ginčas galutinai sprendžiamas Lietuvos Respublikos įstatymų nustatyta tvarka teismuose, pagal Administratoriaus buveinės vietą.</li>\r\n	<li>&Scaron;alys susitaria, jog Administratorius gali bet kuriuo metu perleisti savo teises ir pareigas, kylančias i&scaron; &scaron;ių Taisyklių tretiesiems asmenims be Jūsų sutikimo ir Jums apie tai neprane&scaron;ęs.</li>\r\n</ol>\r\n', '2014-03-25 09:50:25', '0000-00-00 00:00:00', 3, 'taisykles', 0, 0),
	(36, 0, 'Rezultatai', '', '2014-04-06 12:26:00', '0000-00-00 00:00:00', 3, 'rezultatai', 2, 0),
	(37, 0, 'Apie organizaciją', '<h2>V&scaron;Į Geros valios projektai</h2>\r\n\r\n<p>V&scaron;Į Geros valios projektai &ndash; nevyriausybinė ne pelno siekianti organizacija, įkurta 2008 m. balandžio 15 d.</p>\r\n\r\n<p>Organizacijos vizija: bendruomeni&scaron;ka visuomenė, kurioje esame organizacijų partneriai ir piliečių patarėjai, priimant tinkamus geros valios sprendimus.</p>\r\n\r\n<p>Ilgalaikis tikslas &ndash; suburti atskirų sričių specialistus, kurie versle, mokslinėje ar visuomeninėje veikloje įgytą patirtį panaudotų socialiniams paramos projektams vystyti, valdyti ir įgyvendinti.</p>\r\n\r\n<p>Organizacija administruoja pirmąjį aukojimo portalą<strong> <a href="http://www.aukok.lt" target="_blank">Aukok.lt</a></strong> ir kitas &bdquo;Gerumo tinklo&ldquo; iniciatyvas: paramos daiktais tinklą <strong><a href="http://www.aukokdaiktus.lt">aukokdaiktus.lt</a></strong> bei bendruomeni&scaron;kos pagalbos vieni kitiems projektą <strong><a href="http://www.aukoklaika.lt">Pagalbardarbais.lt</a></strong>. aukokdaiktus.lt iniciatyva sukurta bendradarbiaujant su Labdaros ir paramos fondu Pilietinės atsakomybės fondas.</p>\r\n\r\n<h2>Iniciatyvos</h2>\r\n\r\n<table align="center" border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align:center; width:33%"><a href="http://www.aukokdaiktus.lt"><img alt="" src="http://www.aukoklaika.lt/img/logodaiktais.png" style="height:77px; width:208px" /></a></td>\r\n			<td style="text-align:center; width:33%"><a href="http://www.aukok.lt"><img alt="" src="https://www.aukok.lt/content/img/logo.png" style="height:35px; width:90px" /></a></td>\r\n			<td style="text-align:center; width:33%"><a href="http://www.aukoklaika.lt"><img alt="" src="http://www.aukoklaika.lt/img/logodarbais.png" style="height:41px; width:203px" /></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>[PARASTE]</p>\r\n\r\n<h2 style="margin-top:0pt">Paremk mus</h2>\r\n\r\n<p>Jei norite paremti gerumo tinklo&nbsp;<a href="http://www.aukokdaiktus.lt/">aukokdaiktus.lt</a>&nbsp;vystymą, galite tai padaryti pervesdami iki 2% savo pajamų mokesčio iki 2015-05-01:</p>\r\n\r\n<p>1. Prisijunkite prie <a href="https://deklaravimas.vmi.lt/lt/Pradinis_Prisijungimo_puslapis/Prisijungimasperisorinessistemas.aspx" target="_blank">Elektroninės deklaravimo sistemos</a>&nbsp;(EDS).<br />\r\n2. Vir&scaron;utiniame horizontaliajame EDS meniu pasirinkite &bdquo;EDS funkcijos&ldquo;, tuomet de&scaron;iniajame vertikaliame meniu &ndash; &bdquo;Paramos skyrimas&ldquo;.<br />\r\n3. Užpildykite FR0512 v.2 formą tiesiogiai EDS portale (online).&nbsp;<br />\r\n4. Formoje užpildykite asmeninius duomenis bei &scaron;iuos laukelius, (!) pažymėtus laukelius užpildyti būtina:</p>\r\n\r\n<p>&nbsp; &nbsp; (!) &nbsp; &nbsp;5 Mokestinis laikotarpis &ndash; 2014<br />\r\n&nbsp; &nbsp; (!) 6S Mokesčio dalį skiriu vienetams, turintiems teisę gauti paramą &ndash;&nbsp;✔<br />\r\n&nbsp; &nbsp; (!) E1 Gavėjo tipas &ndash; 2 [paramos gavėjas]<br />\r\n&nbsp; &nbsp; (!) E2 Gavėjo identifikacinis numeris (kodas) &ndash; 301678868<br />\r\n&nbsp; &nbsp; (!) E3 Mokesčio dalies paskirtis &ndash;&nbsp;<a href="http://aukok.lt/" target="_blank">aukokdaiktus.LT</a><br />\r\n&nbsp; &nbsp; (!) E4 Mokesčio dalies dydis (procentais) &ndash; iki 2,00<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;E5 Mokesčio dalį skiriu iki mokestinio laikotarpio &ndash; vėliausiai iki 2018 m. [pildoma tik norint paramą skirti ilgiau kaip 1 metus]<br />\r\n<br />\r\nJei turite papildomų klausimų, būtinai kreipkitės į mus el. pa&scaron;tu&nbsp;<a href="mailto:info@aukokdaiktus.lt">info@aukokdaiktus.lt</a>. Ra&scaron;ykite elektroninį lai&scaron;ką, jei norėtumėte, kad paskelbtumėme Jūsų, kaip paramos teikėjo, vardą ar norint gauti ataskaitą apie paramos panaudojimą.</p>\r\n\r\n<p>Jei norėtumėte parai&scaron;ką pateikti ne internetu, atsispausdinkite &scaron;į&nbsp;<a href="https://www.aukok.lt/Content/files/uzpildyta_2GPM_PB_2015.pdf" target="_blank">dokumentą</a>, užpildykite ir pristatykite į savo apskrities&nbsp;<a href="http://www.vmi.lt/lt/?itemId=20796" target="_blank">VMI</a>.&nbsp;</p>\r\n\r\n<p><strong>2014 m. sulaukėme net 11 244,19 &euro; paramos.</strong></p>\r\n\r\n<p><strong>2013 m. sulaukėme 2 503,05 &euro; paramos.&nbsp;</strong></p>\r\n\r\n<p><strong>2012 m. sulaukėme 2 198,22 &euro; paramos.</strong></p>\r\n\r\n<p><strong>2011 m. sulaukėme 1 342,05 &euro; paramos.</strong></p>\r\n\r\n<p><strong>2010 m. sulaukėme 1 021,68 &euro; paramos. </strong></p>\r\n\r\n<p><strong>AČIŪ Jums!</strong></p>\r\n', '2015-03-31 19:40:22', '0000-00-00 00:00:00', 1819, 'apieorg', 2, 0),
	(38, 0, 'Konferencija', '<p>Siekiant mažinti socialinę atskirtį, pagal projektą &bdquo;Pagarbadarbais.lt &ndash; efektyviam socialinių problemų sprendimui&ldquo; yra kuriamas NVO ir valstybinio sektorių bendradarbiavimo tinklas. Bendradarbiavimo tinklo nariais tapę socialiniai darbuotojai turi galimybę naudotis internetine paramos daiktais ir darbais sistema, kuri palengvina kasdienį darbą, pritraukiant paramos daiktais bei pagalbos savanori&scaron;kais darbais. Projekto apibendrinimui, sukurto tinklo stiprinimui ir plėtrai organizuojama nacionalinė konferencija <strong>&bdquo;Socialinės atskirties mažinimas įtraukiant piliečius&ldquo;</strong>.</p>\r\n\r\n<p><strong>KUR? V</strong><strong>ie&scaron;bučio &bdquo;Panorama&rdquo; konferencijų centre, Sodų g. 14, Vilniuje</strong></p>\r\n\r\n<p><strong>KADA? Spalio 21 d. &nbsp;</strong></p>\r\n\r\n<p>Konferencijos metu bus apžvelgiamos socialiniams darbuotojams i&scaron; abiejų sektorių aktualios socialinės problemos, dalyviai galės pasidalinti patirtimi, bus supažindinami su aukokdaiktus.lt ir aukoklaika.lt projektais. Po konferencijos dalyviai turės galimybę tapti projekto kuratoriais, savaranki&scaron;kai ir savanori&scaron;kai pagal poreikį naudotis sistema ir taip palengvinti savo kasdienį darbą kitų žmonių pagalba daiktais bei darbais.</p>\r\n\r\n<p>Konferencijoje kviečiami dalyvauti socialiniai darbuotojai i&scaron; skirtingų savivaldybės įstaigų ir įvairių nevyriausybinių organizacijų, seniūnijų, bendruomenių, socialiniai pedagogai, savanoriai i&scaron; labdaros organizacijų, dirbantys su pažeidžiamais asmenimis. Dalyvavimas konferencijoje nemokamas (su maitinimu). Dalyvio indėlis &ndash; atvykimas iki konferencijos vietos. Skatiname darbdavius i&scaron;leisti savo darbuotojus dalyvauti seminare.</p>\r\n\r\n<p><strong>Dalyvių skaičius ribotas, o registracija vyksta iki &scaron;.m. spalio 14 dienos užpildžius <a href="http://docs.google.com/forms/d/1kDdBsYLlyq1Qxdiv9JUCwZ7H_iqEc0acx0iLA-DJbMI/viewform">registracijos anketą</a>.&nbsp;</strong></p>\r\n\r\n<p>Kilus klausimams skambinti telefonu: 8 699 53597</p>\r\n', '2015-03-25 19:42:39', '0000-00-00 00:00:00', 1819, 'konferencija', 2, 0);
